--
-- Name: fc_anos(date, date); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION fc_anos(date, date) RETURNS smallint
    AS $_$
DECLARE
        NASC ALIAS FOR $1;
        HOJE ALIAS FOR $2;
        IDADE int2;
BEGIN
        IDADE := 0;
        IF NASC >= HOJE THEN
	   RETURN IDADE;
        END IF;
        IF TO_CHAR(NASC,'MM') = TO_CHAR(HOJE,'MM') THEN
	   IF TO_NUMBER(TO_CHAR(NASC,'DD'),'999') <= TO_NUMBER(TO_CHAR(HOJE,'DD'),'999') THEN
	      IDADE = TO_NUMBER(TO_CHAR(HOJE,'YYYY'),'9999') - TO_NUMBER(TO_CHAR(NASC,'YYYY'),'9999');
	   ELSE
	      IDADE = TO_NUMBER(TO_CHAR(HOJE,'YYYY'),'9999') - TO_NUMBER(TO_CHAR(NASC,'YYYY'),'9999') - 1;
	   END IF;
	ELSE
	   IF TO_CHAR(NASC,'MM') < TO_CHAR(HOJE,'MM') THEN
	      IDADE = TO_NUMBER(TO_CHAR(HOJE,'YYYY'),'9999') - TO_NUMBER(TO_CHAR(NASC,'YYYY'),'9999');
           ELSE
	      IDADE = TO_NUMBER(TO_CHAR(HOJE,'YYYY'),'9999') - TO_NUMBER(TO_CHAR(NASC,'YYYY'),'9999') - 1;
	   END IF;
	END IF;
RETURN IDADE;
END;
$_$
    LANGUAGE plpgsql;


ALTER FUNCTION public.fc_anos(date, date) OWNER TO postgres;

--
-- Name: fc_calcestoque(integer, integer, integer); Type: FUNCTION; Schema: public; Owner: iuri
--

CREATE FUNCTION fc_calcestoque(integer, integer, integer) RETURNS bigint
    AS $_$
DECLARE
   valimento alias for $1;
   vlote     alias for $2;
   vinst     alias for $3;
   rtentrada record;
   rtsaida   record;
   rttrans   record;
   vtotalent integer;
   vtotalsai integer; 
   vtotalest integer;
   vtotal    integer;
BEGIN
-- SELECIONA O TOTAL DOS ITENS DA ENTRADA 

   SELECT into rtentrada SUM(ent_quantidade) AS tentrada
   FROM   est_entrada 
   WHERE  ent_aliid = valimento
   AND    ent_lote  = vlote
   AND    ent_insid = vinst;

vtotalent := rtentrada.tentrada;

-- SELECIONA O TOTAL DOS ITENS DA SAIDA

   SELECT into rtsaida SUM(sai_quantidade) AS tsaida
   FROM   est_saida 
   WHERE  sai_aliid = valimento
   AND    sai_lote  = vlote
   AND    sai_insid = vinst;
 ---- SELECIONA OS ITENS QUE ESTÃOM TRANSFERENCIAS ABERTAS...
   
 vtotalsai := rtsaida.tsaida;
 SELECT into rttrans SUM(itt_quantidade) AS tsaida
   FROM   est_transferitens inner join est_transferencias
          on itt_transid = tra_id    
   WHERE  itt_aliid = valimento
   AND    itt_lote  = vlote
   AND    tra_insid = vinst
   AND   (tra_sit = '0' or tra_sit isnull);  
vtotalest := rttrans.tsaida;   
RETURN  (sum((vtotalent - coalesce(vtotalsai,0))-coalesce(vtotalest,0)));
END;$_$
    LANGUAGE plpgsql;


