--
-- Name: fc_calcula(real, numeric, character); Type: FUNCTION; Schema: public; Owner: iuri
--

CREATE FUNCTION fc_calcula(real, numeric, character) RETURNS character varying
    AS $_$
DECLARE
        TOTAL                   DECIMAL(8,2);
        PREF                    RECORD;
        orde                    RECORD;
        NOME                    VARCHAR;
        valor                   decimal(8,2);
        teste                   real;
	    debito                  record;
	    mesbase                 integer;
	    mesbaseano              integer;
begin
if $3 = 0 then
    SELECT ass_nome,
           ROUND(SUM(pref_salario*(0.23+round(($2/100::decimal),2))),2) as salario
    INTO   PREF       
    from   contratos_pref inner join afastamentos 
        on contratos_pref.pref_id  = afastamentos.pref_id 
        inner join associados on contratos_pref.ass_id = associados.ass_id  
    where  sit_id  not in(10,12,11,6,3,9) 
    and    associados.ass_id = $1
    group  by ass_nome;
elsif $3 = 1 then 

    SELECT ROUND(SUM(cam_salario*(0.23+round(($2/100::decimal),2))),2) as salario
    INTO   PREF       
    from   contratos_cam where
            cam_assid = $1;
end if;
    
    if not found then 
        TOTAL := 0;
    else
    
    if (extract(day from now()) >= 16) then
         if (extract(month from now()) = 12) then
             mesbase    := 1;
             mesbaseano := extract(year from now()+1);
          else
             mesbase    := extract(month from now()) + 1;
             mesbaseano := extract(year from now());    
          end if;
     else
         mesbase    := extract(month from now());
         mesbaseano := extract(year from now());         
     end if;  
     
      
         
        
        select associados.ass_id,
        round(sum((case when par_valor = 0.00 then par_limite else par_valor end)),2) as valor_pagar 
	into   orde        
	from   associados inner join ordens on associados.ass_id = ordens.ass_id 
          inner join fornecedores on fornecedores.for_id = ordens.for_id 
      	  left outer join parcelas_ord on ordens.ord_id = parcelas_ord.ord_id
		  where  par_base   = mesbase
	  	  and	par_baseano = mesbaseano
				
	and associados.ass_id = $1 
    group  by associados.ass_id;
    
   if not found then
      TOTAL := round(pref.salario,2);
   else
      valor := round(pref.salario,2);
      if orde.valor_pagar = null or orde.valor_pagar = 0.00 then
         TOTAL := round(valor,2);
      else   
         TOTAL := round(sum((valor - orde.valor_pagar)),2);
      end if;   
   end if;
end if;   
return mesbase||'-'mesbaseano;
END;
$_$
    LANGUAGE plpgsql;


ALTER FUNCTION public.fc_calcula(real, numeric, character) OWNER TO iuri;

