--

CREATE FUNCTION fc_feriado(date) RETURNS character varying
    AS $_$
Declare
      feriado  varchar(100);
      data     date;
      rs       record;
Begin

  data := $1;
  select fer_descr into rs
  from   sis_feriados
  where  fer_dtferiado = data;

  feriado := rs.fer_descr;
  return feriado;
End;
$_$
    LANGUAGE plpgsql;


ALTER FUNCTION public.fc_feriado(date) OWNER TO iuri;

--
-- Name: fc_mesbase(date); Type: FUNCTION; Schema: public; Owner: iuri
--

CREATE FUNCTION fc_mesbase(date) RETURNS integer
    AS $_$
DECLARE
    data    alias for $1; 
    mesbase integer;
    mes     integer;
    dia     integer;
BEGIN
 dia := extract (day from data);
 mes := extract(month from data);
 if dia <=15 then
    mesbase := mes -1;
 else
    mesbase := mes;
 end if;

 return mesbase;
 end;$_$
    LANGUAGE plpgsql;


ALTER FUNCTION public.fc_mesbase(date) OWNER TO iuri;

--
-- Name: fc_mesextenso(numeric); Type: FUNCTION; Schema: public; Owner: iuri
--

CREATE FUNCTION fc_mesextenso(numeric) RETURNS character varying
    AS $_$
DECLARE
    par    alias for $1; 
    mes    varchar(35);
BEGIN
mes := case when par = 1  then 'Janeiro'
              when par = 2  then 'Fevereiro'
              when par = 3  then 'Março'
              when par = 4  then 'Abril'
              when par = 5  then 'Maio'
              when par = 6  then 'Junho'
              when par = 7  then 'Julho'
              when par = 8  then 'Agosto'
              when par = 9  then 'Setembro'
              when par = 10 then 'Outubro'
              when par = 11 then 'Novembro' 
              when par = 12 then 'Dezembro' end ;
return mes;
end;$_$
    LANGUAGE plpgsql;


ALTER FUNCTION public.fc_mesextenso(numeric) OWNER TO iuri;

--
-- Name: fc_valnutricional(integer); Type: FUNCTION; Schema: public; Owner: iuri
--

CREATE FUNCTION fc_valnutricional(integer) RETURNS character varying
    AS $_$
DECLARE 
      cardapio            alias for $1;
      lalimentos          record;
      valnutricional      varchar;
      sql                 varchar;
      vproteinas          decimal(12,2);
      vcarboidratos       decimal(12,2);
      vcalorias           decimal(12,2);   
BEGIN
SELECT into lalimentos round(sum((itc_quantidade*ali_proteina)/100),2) as proteinas,
                       round(sum((itc_quantidade*ali_carboidrato)/100),2) as carboidratos,
                       round(sum((itc_quantidade*ali_lipidios)/100),2) as lipidios,
                       round((sum(itc_quantidade*ali_calcio)/100),2) as calcio,
                       round(sum((itc_quantidade*ali_fosforo)/100),2) as fosforo,
                       round(sum((itc_quantidade*ali_ferro)/100),2) as ferro,
                       round(sum((itc_quantidade*ali_vitama)/100),2) as vitamina_a,
                       round(sum((itc_quantidade*ali_vitamc)/100),2) as vitamina_C 
FROM  alimentos inner join itens_cardapio on ali_id = itc_aliid 
      inner join cardapios on itc_carid = car_id
WHERE ali_id  IN(select ali_id FROM itens_cardapio WHERE itc_carid=2) and car_id = cardapio;

vcalorias = (lalimentos.carboidratos*4)+(lalimentos.proteinas*4)+(lalimentos.lipidios*9);
valnutricional := 'pro'||lalimentos.proteinas::varchar||'#car'||lalimentos.carboidratos::varchar;
valnutricional := valnutricional||'#lip'||lalimentos.lipidios::varchar||'#cal'||lalimentos.calcio::varchar||'#fos'||lalimentos.fosforo;
valnutricional := valnutricional||'#fer'||lalimentos.ferro::varchar||'#via'||lalimentos.vitamina_a||'#vic'||lalimentos.vitamina_c||'#cal'||vcalorias;
RETURN  valnutricional;
END;$_$
    LANGUAGE plpgsql;


ALTER FUNCTION public.fc_valnutricional(integer) OWNER TO iuri;

