--
-- Name: professor_disciplina; Type: VIEW; Schema: public; Owner: iuri
--

CREATE VIEW professor_disciplina AS
    SELECT DISTINCT ON (p.prof_nome) p.prof_nome, p.prof_id, cp.car_id AS cod_cargahoraria, d.dis_nome, d.dis_id, i.ins_nome, cp.car_instint, cp.car_ano FROM ((((carga_prof cp JOIN contratos c ON ((cp.con_id = c.con_id))) JOIN professores p ON ((c.prof_id = p.prof_id))) JOIN disciplinas d ON ((cp.dis_id = d.dis_id))) JOIN instituicoes i ON ((i.ins_id = cp.car_instint))) ORDER BY p.prof_nome;


