-- Name: vw_contratos; Type: VIEW; Schema: public; Owner: iuri
--

CREATE VIEW vw_contratos AS
    SELECT p.prof_nome, cargos.carg_descr, tipo_contratos.tip_nome, c.con_dtentrada, to_char((c.con_dtdemiss)::timestamp with time zone, 'DD/MM/YYYY'::text) AS dtdemiss, to_char((c.con_dtfono)::timestamp with time zone, 'DD/MM/YYYY'::text) AS dtfono, c.con_fono, c.con_portaria, to_char((c.con_dtport)::timestamp with time zone, 'DD/MM/YYYY'::text) AS dtportaria, c.con_horas, c.con_trienio, c.con_classe, c.con_nivel, c.con_matricula, c.prof_id, CASE WHEN (c.con_situacao = (1)::numeric) THEN 'Permuta'::text WHEN (c.con_situacao = (2)::numeric) THEN 'Cedencia'::text WHEN (c.con_situacao = (3)::numeric) THEN 'Pradem'::text WHEN (c.con_situacao = (4)::numeric) THEN 'Normal'::text ELSE NULL::text END AS situacao FROM (((professores p JOIN contratos c ON ((p.prof_id = c.prof_id))) JOIN cargos ON ((c.con_cargid = cargos.carg_id))) JOIN tipo_contratos ON ((c.con_tipo = tipo_contratos.tip_id)));


ALTER TABLE public.vw_contratos OWNER TO iuri;

