 <font size="1" style="font-family: verdana,arial,helvetica,sans-serif;">
 
 
 As escolas municipais de Educação Infantil Dominó, Arco Íris e Ayrton Senna promovem o II Baile da Integração do Bairro Amaral Ribeiro no dia 07 de agosto. O evento, com início às 22 horas, será realizado no ginásio do SESI e terá a animação da Banda Doce Emoção. Os pais serão homenageados pela passagem do Dia dos Pais, com os primeiros 300 que chegarem à festa sendo presenteados com lembranças. Durante a noite haverá também sorteio de brindes entre os pais presentes. <br />O objetivo com o evento é promover a integração e a cooperação na comunidade, além de arrecadar fundos paras as escolas. Os ingressos antecipados serão vendidos nas secretarias das escolas e membros das APMs custando 4 reais o masculino e 3 reais o feminino. No dia, os ingressos custarão 5 e 4 reais.</font>  
