 <span style="font-family: verdana,arial,helvetica,sans-serif;"><font size="2" style="font-weight: bold;">
 
 O</font> <font size="1">Ministério da Educação (MEC) promove o </font></span><font size="1"><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Concurso Nacional de Frases</span><span style="font-family: verdana,arial,helvetica,sans-serif;"> com o tema </span><span style="font-style: italic; font-family: verdana,arial,helvetica,sans-serif;">Os Direitos da Criança Brasileira</span><span style="font-family: verdana,arial,helvetica,sans-serif;">, que premiará alunos de 5ª a 8ª série do Ensino Fundamental das escolas de rede pública de todo o Brasil. O regulamento e os envelopes de inscrição estão disponibilizados nas escolas. A carta-resposta deverá ser encaminhada ao MEC até o dia 10 de agosto e só terão validade as que forem postadas no correio até este dia.</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">O objetivo é estimular a reflexão, em sala de aula, sobre a necessidade de se ampliar a responsabilidade de indivíduos, famílias, grupos sociais, escolas e instituições na proteção dos direitos da criança e do adolescente. Este concurso integra o Projeto MEC/Nestlé de Valorização de Crianças e Adolescentes que está viabilizando, também, a doação de exemplares do </span><span style="font-style: italic; font-family: verdana,arial,helvetica,sans-serif;">Estatuto da Criança e do Adolescente</span><span style="font-family: verdana,arial,helvetica,sans-serif;"> para as bibliotecas das escolas e orientar no processo de pesquisa e elaboração das frases.</span></font>    
         ', NULL, '2004-08-03', 11, '2004-07-23', '2004-08-09', NULL, NULL, NULL, NULL);
 <p style="color: rgb(204, 0, 0);"><font style="font-family: verdana,arial,helvetica,sans-serif;" size="3"><b>CULTURA</b></font></p><p><span style="font-family: verdana,arial,helvetica,sans-serif;">No dia 8, a programação do projeto Domingo na Praça trará a música sertaneja para o público que visita a Praça da Bandeira, em Sapiranga. A atração desta semana são as duplas vencedoras do VII Festival da Música Sertaneja, realizado recentemente na 14ª Festa do Motorista no município. A programação ocorre das 17 às 19 horas. Informações pelo telefone 529-1054.</span></p>
<p><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font style="font-family: verdana,arial,helvetica,sans-serif;" size="4"><font size="1">A dupla Luis e Elimar, ambos de Sapiranga, se apresentam ao som do violão das 17 às 18 horas. Os sapiranguenses conquistaram o terceiro lugar no festival. A dupla vencedora do evento, João e Leandro, de Novo Hamburgo, fará show das 18 às 19 horas, também acompanhados do violão. Os artistas João Manoel e Gilmar, de Sapiranga, que conquistaram o segundo lugar no festival, tiveram que cancelar a participação devido a atividades agendadas anteriormente.</font> </font></p>

  ', NULL, '2004-08-04', 3, '2004-08-04', '2004-08-09', NULL, NULL, 0, NULL);
</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">O espetáculo tem duração de 1h40min. A concepção e direção é do artista Hique Gomez, um dos criadores de Tangos e Tragédias. </span><br />
 ', 86016281, '2004-07-26', 12, '2004-07-26', '2004-07-27', 'radio_esmeralda.jpg', 'Divulgação', 0, NULL);
 <p style="font-weight: bold; color: rgb(204, 0, 0);"><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">LAZER</span></font></p><p><font size="2"><span style="font-family: verdana,arial,helvetica,sans-serif;">#imagem#</span></font></p><p><font size="2"><span style="font-family: verdana,arial,helvetica,sans-serif;">O Centro Municipal de Cultura Lúcio Fleck de Sapiranga está sendo preparando para receber centenas de pessoas a partir do próximo fim-de-semana. No sábado (31) e domingo (1), </span></font><font style="font-family: verdana,arial,helvetica,sans-serif;" size="2"><i>Homem-Aranha 2</i></font><font size="2"><span style="font-family: verdana,arial,helvetica,sans-serif;"> entra em cartaz, às 16 h e 20h30. Ao todo, serão 22 sessões durante o mês de agosto. Temos acompanhado a grande procura nos cinemas da capital e da região, além de recebermos muitos pedidos pela exibição do filme. Por isso, resolvemos ampliar as opções de horários e dias de exibição, explica a diretora do espaço cultural, Nelci Strauss Fülber. O ingresso custa R$ 5,00 e R$ 3,00. Informações pelo telefone 599-4058.
</span></font></p><p><font size="2"><span style="font-family: verdana,arial,helvetica,sans-serif;">O filme estará em cartaz no centro cultural nos finais de semana, às 16 horas e 20h30, nos dias 31 e 1º de agosto, 7 e 8, 14 e 15 e no dia 22. Haverá sessões durante a semana, sempre às 20h30, a começar pelo dia 3, 4, 5, 10, 12, 17, 18 e 19 de agosto. </span></font></p><p><font style="font-family: verdana,arial,helvetica,sans-serif;" size="2"><b>Sinopse: </b></font><font size="2"><span style="font-family: verdana,arial,helvetica,sans-serif;">Em Homem-Aranha 2, a mais recente criação da série de grande sucesso Homem-Aranha baseada no clássico herói da Marvel Comics, Tobey Maguire volta como o gentil Peter Parker, o jovem que se esforça para manter o delicado equilíbrio de sua vida dupla, como estudante universitário e como a criatura super-humana que luta contra o crime. A prazerosa aventura torna-se cada vez mais séria, e a vida do Homem-Aranha ainda mais complicada, quando ele enfrenta um novo temível adversário, o inteligente Otto Octavius (Alfred Molina), que ressurge como o maníaco e multi-tentáculos &quot;Doc Ock&quot;.
</span></font></p><p><font size="2"><span style="font-weight: bold;">Sessões:</span><br /><span style="font-weight: bold;">
31 e 1/08</span>  16h  20h30<br /><span style="font-weight: bold;">
7 e 8/08</span>  16h  20h30<br /><span style="font-weight: bold;">
14 e 15/08</span>  16h  20h30<br /><span style="font-weight: bold;">
22/08</span> 16h  20h30 <br /><span style="font-weight: bold;">
3, 4, 5, 10, 12, 17, 18, 19/08</span>- 20h30</font></p><br />
  ', 86016283, '2004-07-28', 3, '2004-07-28', '2004-07-30', 'homem_aranha_2_i.jpg', 'foto: divulgação', 0, NULL);
