 <p style="font-weight: bold; color: rgb(204, 0, 0);"><span style="font-family: verdana,arial,helvetica,sans-serif;">CULTURA</span></p><p><span style="font-family: verdana,arial,helvetica,sans-serif;">O 1º Face  Festival de Arte, Cultura e Esporte vai relembrar os 130 anos do Episódio Mucker em Sapiranga. Neste sábado e domingo (7 e 8), doze bandas subirão no palco do Parque Municipal do Imigrante. Haverá também a apresentação da peça teatral </span><font style="font-family: verdana,arial,helvetica,sans-serif;" size="3"><i>Rosas para Jacobina, </i></font><span style="font-family: verdana,arial,helvetica,sans-serif;">com dezenas de atores no elenco. A programação começa às 16 horas, com ingresso a R$ 5,00. Paralelo ao evento, ocorre o Festival Vôo Livre, no Morro Ferrabraz, das 13 às 17 horas. Informações junto à Secretaria de Cultura e Turismo, pelo telefone 529-1054, ou junto à Associação Gaúcha de Vôo Livre, no telefone 559-2552. </span></p>
<p><span style="font-family: verdana,arial,helvetica,sans-serif;">No sábado, a partir das 16 horas, farão show no parque as bandas Alcaholly, Quarto Studio, Eyebrow, Ecosofia, Dr. Janck, Dose de Rock e Sasquatch. No segundo dia, também às 16 horas, se apresentam as bandas Via Brasil, Acústico Blues, Kollyn, Folha Seca e Stoneanos. </span></p>
<p><font style="font-family: verdana,arial,helvetica,sans-serif;" size="3">A Associação Gaúcha de Vôo Livre organiza, paralelamente, o Festival de Vôo Livre. Pilotos de asa-delta e paraglider estarão colorindo o céu próximo do Morro Ferrabraz das 13 às 17 horas.</font></p>
<p><font style="font-family: verdana,arial,helvetica,sans-serif;" size="3"><b>Teatro</b></font></p><p><span style="font-family: verdana,arial,helvetica,sans-serif;">
Entre as apresentações das bandas ocorrerá o espetáculo teatral </span><font style="font-family: verdana,arial,helvetica,sans-serif;" size="3"><i>Rosas para</i></font><span style="font-family: verdana,arial,helvetica,sans-serif;">Jacobina, escrita e dirigida pela artista Crau, de Sapiranga, com a consultoria da historiadora Dóris Rejane Fernandes Magalhães. A peça vai ilustrar o drama pessoal daqueles que viveram o conflito que teve desfecho trágico em 1874. Os mucker e os anti-mucker serão interpretados por atores com menos de um ano até 55 anos de idade, o mais velho do elenco. O projeto vem sendo desenvolvido há dois meses e conta com o apoio de vários moradores, que auxiliam na elaboração do figurino, do cenário, da trilha sonora e pesquisa.</span>
 </p> ', 86016293, '2004-08-03', 3, '2004-08-03', '2004-08-03', 'Dose do Rock.jpg', 'Izabela Backes ', 0, NULL);
<p><span style="font-family: verdana,arial,helvetica,sans-serif;">No sábado, a partir das 16 horas, farão show no parque as bandas Alcaholly, Quarto Studio, Eyebrow, Ecosofia, Dr. Janck, Dose de Rock e Sasquatch. No segundo dia, também às 16 horas, se apresentam as bandas Via Brasil, Acústico Blues, Kollyn, Folha Seca e Stoneanos. </span></p>
<p><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A Associação Gaúcha de Vôo Livre organiza, paralelamente, o Festival de Vôo Livre. Pilotos de asa-delta e paraglider estarão colorindo o céu próximo do Morro Ferrabraz das 13 às 17 horas.</font></p>

