Bandeira e chegada no Parque Municipal do Imigrante.</span></font></font></td><td style="border-style: none; background-image: none; text-align: left; vertical-align: top;">#imagem#<br /></td></tr><tr align="justify"><td rowspan="1" colspan="2"><span style="font-family: verdana,arial,helvetica,sans-serif;"><font size="2"><font size="2"><font size="2"><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">No local, será
realizada uma missa e a entrega da premiação. O concurso propôs a
elaboração de cartazes, frases ou redações com o tema Família, e
envolveu as três redes de ensino de Sapiranga</span></font></font></font><font size="2"><font size="2"><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">.</span></font></font></font></font></span><font size="2"><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">Os vencedores na categoria de Pré-escola à 4</span><sup style="font-family: verdana,arial,helvetica,sans-serif;">o</sup><span style="font-family: verdana,arial,helvetica,sans-serif;"> série elaboraram cartazes ou frases e receberão kits pedagógicos. Já o aluno de 5</span><sup style="font-family: verdana,arial,helvetica,sans-serif;">o</sup><span style="font-family: verdana,arial,helvetica,sans-serif;"> à 8</span><sup style="font-family: verdana,arial,helvetica,sans-serif;">o</sup><span style="font-family: verdana,arial,helvetica,sans-serif;">
série ganhará uma bicicleta pela redação que abordava o tema do
concurso. Toda a comunidade e escolas estão convidadas para o evento.
Na foto, a comissão julgadora do concurso (da esq. para a direita):
</span></font></font><font size="2"><font size="2"><font size="2"><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">Ivone Petry (segunda na ordem), da Pastoral,</span></font></font></font></font><font size="2"><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;"> com as professoras Ana Lúcia Silveira, Cléia Viviane Schneider, Marlise Cristina Waschburger Silva e Lisete Henrich, todas da Secretaria de Educação e Desporto.</span></font></font><br /></td></tr></tbody></table></font></font><font size="2"><font size="2" style="font-weight: bold;"><br /></font><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">&nbsp;</span></font></font><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;"></span><span style="font-family: verdana,arial,helvetica,sans-serif;">&nbsp;</span></font><font size="2"><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;"></span><span style="font-family: verdana,arial,helvetica,sans-serif;">&nbsp;</span></font><span style="font-weight: bold;"><br /></span></font>
