<p style="margin-bottom: 0cm;" align="justify"><font size="2">Neste sábado e
domingo (7 e 8), ocorrerá o 1º Face  Festival de Arte,
Cultura e Esporte para relembrar os 130 anos do Episódio
Mucker em Sapiranga. A programação começa às
16 horas no Parque Municipal do Imigrante, com show de doze bandas e
apresentação da peça teatral <i>Rosas para
Jacobina. </i><span style="font-style: normal;">Ingressos a R$ 5,00. </span><span style="font-style: normal;">


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title>
	
