	</style>

<p style="margin-bottom: 0cm;" align="justify"><span style="font-style: normal;">Paralelo
ao evento, ocorre o Festival Vôo Livre, no Morro Ferrabraz, das
13 às 17 horas. Em caso de chuva, o festival de vôo
livre será cancelado e o festival no parque ocorrerá
normalmente. Informações junto à Secretaria de
Cultura e Turismo, pelo telefone 529-1054, ou junto à
Associação Gaúcha de Vôo Livre, no
telefone 559-2552.  </span><span style="font-style: normal;">


