	</style>

<p style="margin-bottom: 0cm; font-style: normal;" align="justify">No
sábado, a partir das 16 horas, farão show no parque as
bandas Alcaholly, Quarto Studio, Eyebrow, Ecosofia, Dr. Janck, Dose
de Rock e Sasquatch. No segundo dia, também às 16
horas, se apresentam as bandas Via Brasil, Acústico Blues,
Kollyn, Folha Seca e Stoneanos.


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title>
	
