<p style="margin-bottom: 0cm; font-style: normal;" align="justify"><b>Teatro</b></p>
<p style="margin-bottom: 0cm; font-style: normal;" align="justify">Entre
as apresentações das bandas ocorrerá o
espetáculo teatral <i>Rosas para </i>Jacobina, escrita e
dirigida pela artista Crau, de Sapiranga, com a consultoria da
historiadora Dóris Rejane Fernandes Magalhães. A peça
vai ilustrar o drama pessoal daqueles que viveram o conflito que teve
desfecho trágico em 1874. <meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />


	
	
	
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;
	</style>

<p style="margin-bottom: 0cm; font-style: normal;" align="justify">Os
mucker e os anti-mucker serão interpretados por atores com
menos de um ano até 55 anos de idade, o mais velho do elenco.
O projeto vem sendo desenvolvido há dois meses e conta com o
apoio de vários moradores, que auxiliam na elaboração
do figurino, do cenário, da trilha sonora e pesquisa. 
</p>

</p>
 
</p>
</span>
</p>
</span></font>
</p>
<font size="2"><br /></font></p>

