<p style="margin-bottom: 0cm; font-family: verdana,arial,helvetica,sans-serif;" align="justify"><font size="2">A artista plástica
Janaína Alves, de Novo Hamburgo, apresenta nova exposição
no Centro Municipal de Cultura Lúcio Fleck, em Sapiranga. São
25 telas nas técnicas em óleo, pastel oleoso e aquarela
que compõe a exposição Inspirações.<br /></font></p><p style="margin-bottom: 0cm;" align="justify">


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	
	
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;
	</style>

<p style="margin-bottom: 0cm; font-family: verdana,arial,helvetica,sans-serif;" align="justify"><font size="2">Paisagens, animais e
outros temas podem ser reconhecidos em trabalhos com contrastes de
cores e formas. Graças a esses efeitos, o expectador tem a
impressão de ''entrar'' dentro da obra, como se estivesse
olhando de uma janela para fora, descreve Janaína. Ela
tenta explorar uma ilusão óptica de três
dimensões em cima de uma superfície de apenas duas
dimensões, como é a tela.<br /></font></p><p style="margin-bottom: 0cm;" align="justify">


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	
	
