<p style="margin-bottom: 0cm;" align="justify"><font size="2"><span style="font-family: verdana,arial,helvetica,sans-serif;">	A visitação
pode ser feita de segunda a sexta-feira, das 8 às 11h30 e das
12h30 até 22h e nos sábado e domingos, quando há
atividades na casa, que fica localizada na rua Sete de Setembro, 766.
Informações pelo telefone 599-4058.</span></font>  
</p>
 
</p>

</p>

