 A Escola Municipal de Ensino Fundamental Maria Emília de Paula realiza Ação Social na tarde deste sábado, dia 14, como parte das comemorações de 18 anos da instituição. O evento, das 14 às 17 horas, contará com exposições de objetos folclóricos, mostra fotográfica da história da escola, brincadeiras e rodas de chimarrão. Haverá, também, a escolha do Garoto e Garota Maria Emília.<br />A Ação Social oferecerá aos visitantes diversos serviços gratuitos como corte de cabelo, confecção de carteiras de identidade e de trabalho, entre outros. A escola fica na Rua Luís Osvaldo Bender, 277, Vila Irma. Maiores informações pelo telefone 599-3954.<br />      
