<p style="margin-bottom: 0cm; font-family: verdana,arial,helvetica,sans-serif;" align="justify"><font size="2">Duas atrações
compõem o projeto Domingo na Praça, realizado na Praça
da Bandeira de Sapiranga. A partir das 17 horas, Vantuir na voz e
violão apresenta composições próprias e
músicas covers como Red Hot Chili Pepers, Oasis, U2, Pearl
Jam, entre outras. Às 18 horas, a
banda Expresso 77, de Novo Hamburgo, mostram o trabalho, inserindo
também músicas covers de Rolling Stones, Bob Dylan, The
Doors e U2. 
	A erva e o chimarrão
são oferecidos aos visitantes, numa parceria mantida entre a
Secretaria de Cultura e Turismo e uma ervateira local. A entrada é
franca. Informações pelo telefone 529-1054.<br /></font><style>
