<p style="margin-bottom: 0cm; font-style: normal; text-decoration: none;">
<font color="#000000" size="2">Vantuir
é ex-integrante das bandas Origem Scream e Urtiga, de Dois
Irmãos. A banda Expresso 77 é composta por Henrique
Flesch (voz e violão), Fernandinho K (guitarra), Fernando
Lazarin (baixo), Rafael Pereira (bateria) e Eliéser (teclado).</font></p>

 
</p>

