<p style="margin-bottom: 0cm; font-style: normal; text-decoration: none; font-family: verdana,arial,helvetica,sans-serif;">
<font color="#000000" size="2">As
paróquias de Sapiranga convidam a comunidade para participar
do momento de reflexão alusiva à Família. Neste
domingo (15), as igrejas Sagrado Coração de Jesus, São
Luiz Gonzaga e São João Batista promovem uma caminhada
e uma missa, marcando o encerramento da Semana da Família. </font><meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />


	
	
	
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;</style><font color="#000000" size="2">A
concentração será às 9 horas, na Praça
da Bandeira, seguindo em direção ao Parque Municipal do
Imigrante, onde ocorrerá a missa. Após, haverá a
entrega dos prêmios dos vencedores do Concurso de Redação,
Cartaz ou Desenho sobre a Família. </font><p style="margin-bottom: 0cm; font-style: normal; text-decoration: none;">&nbsp;</p>
</p>
<font size="2"><br style="font-family: verdana,arial,helvetica,sans-serif;" /></font>
