	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;
	</style>

<p style="margin-bottom: 0cm;" align="justify">A concentração
será às 9 horas, na Praça da Bandeira, seguindo
em direção ao Parque Municipal do Imigrante, onde
ocorrerá a missa. Após, haverá a entrega dos
prêmios dos vencedores do Concurso de Redação,
Cartaz ou Desenho sobre a Família. 
</p>
</p>
<br />
 ', NULL, '2004-08-12', 12, '2004-08-12', '2004-08-16', NULL, NULL, 0, NULL);


