<p style="margin-bottom: 0cm; font-family: verdana,arial,helvetica,sans-serif;" align="justify">O Centro Municipal de
Cultura Lúcio Fleck continua exibindo o filme que conta a
história de <i>Peter Parker</i>, interpretado por <span style="font-style: normal;">Tobey
Maguire</span>, o jovem que se esforça em manter o equilíbro
entre a vida de estudante universitário e de criatura
super-humana que luta contra o crime. 


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title>
	
