	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
	--</style>Dessa vez, em o
Homem-Aranha 2, o desafio é enfrentar os multi-tentáculos
de<i> Doc Ock</i> (Alfred Molina). As próximas sessões
ocorrem no sábado e domingo, às 16 horas e às
20h30. Ingressos a R$ 5,00 e R$ 3,00 (estudantes). Informações
pelo telefone 599-4058.
 
</p>
<br />
 ', NULL, '2004-08-12', 12, '2004-08-12', '2004-08-16', NULL, NULL, 0, NULL);


