	</style>

<p style="margin-bottom: 0cm; font-family: verdana,arial,helvetica,sans-serif;" align="justify">No dia 4 de setembro,
Sapiranga estará sediando o I Torneio Aberto de Xadrez e a 4ª
Etapa do Circuito Escolar Gaúcho. A programação
ocorre das 8h30 às 17h30 no Centro Municipal de Educação
Dr. Décio Gomes Pereira, localizado na avenida Presidente
Kennedy, 2222, no bairro São Luiz. 


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title>
	
	<meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;</style> Troféus e medalhas
serão oferecidos aos vencedores das sete categorias criadas
para enxadristas com mais de oito anos de idade. As inscrições
custam R$ 2,00 (antecipados na secretaria das escolas ou por meio de
depósito bancário) ou R$ 5,00 na hora. O telefone para
informações é o 529-2198.<br /></p><p style="margin-bottom: 0cm; font-family: verdana,arial,helvetica,sans-serif;" align="justify">


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	
	
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;
	</style>

<p style="margin-bottom: 0cm;" align="justify">Crianças, jovens e
adultos são aguardados para a primeira edição do
torneio, que ocorrerá em forma de emparceiramento no sistema
suíço, com cinco rodadas. O tempo de reflexão é
de 30 minutos. 


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title>
	
	<meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;</style>A Federação
Gaúcha de Xadrez estará realizando a arbitragem dos
jogos, com tempo de reflexão de 30 minutos cada. Cada
participante deve trazer um jogo de peças e na categoria
Adulto, se possível um relógio de xadrez.<br /></p><p style="margin-bottom: 0cm;" align="justify">


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	
	
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;
	</style>

<p style="margin-bottom: 0cm;" align="justify"><meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />O estabelecimento de
ensino junto com a Secretaria de Educação e Desporto de
Sapiranga pretendem reunir os enxadristas de toda a região a
fim de estimular a prática do xadrez e promover a integração
entre os participantes.


	
	
	
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;</style>Queremos demonstrar à
comunidade o quanto o exercício do xadrez traz benefícios
sociais e intelectuais para o praticante, explica o professor
Silas Camacho, que lidera um grupo de xadrez na escola desde março
de 2002.<br /></p><p style="margin-bottom: 0cm;" align="justify">


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	
	
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;
	</style>

<p style="margin-bottom: 0cm;" align="justify">A inscrição
por meio de depósito bancário pode ser feito na Caixa
Econômica Federal Agência 0514, conta da Associação
de Pais e Mestres número 03000788-8, mediante comprovação
via fax pelo telefone 529-2198 com Silas. 
</p>
<p style="margin-bottom: 0cm;" align="justify">


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	
	
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;
	</style>

<p style="margin-bottom: 0cm;" align="justify"><b>Projeto escolar</b></p>
<p style="margin-bottom: 0cm; font-style: normal; text-decoration: none;" align="justify">
<font color="#000000"><font size="3">O
Clube de Xadrez Dr. Peão começou a ser desenvolvido no
centro de educação em março de 2002, durante o
intervalo das aulas, a fim de aplicar a energia das crianças
numa atividade que desenvolve a concentração e o
raciocínio. O
jogo é apaixonante porque existem infinitas possibilidades,
comenta o professor Silas, que coordena a atividade para estudantes
da primeira a oitava série. O grupo já foi composto por
mais de 300 alunos. O mesmo projeto passou a ser desenvolvido pelo
professor André Moreira Chagas, no Centro Municipal de
Educação Ayrton Senna. </font></font>
</p>

</p>
 

</p>
 

 
</p>
 

 
</p>



