	-</style>O filme Homem-Aranha 2
permanece em cartaz no Centro Municipal de Cultura Lúcio
Fleck. Durante a semana, a exibição será feita
nesta terça-feira (17), quarta-feira (18) e quinta-feira (19),
às 20h30. Também haverá
sessão no domingo (22), em dois horários: 16 horas e
20h30. Ingressos a R$ 5,00 e R$ 3,00 (estudantes). Informações
pelo telefone 599-4058.<br /></p><p style="margin-bottom: 0cm;" align="justify">


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	
	
