<p style="font-style: normal; text-decoration: none;" align="justify">
<font color="#000000"><font face="Times New Roman"><font size="3"><b>Sinopse:
</b>Em Homem-Aranha 2, a mais recente criação da série
de grande sucesso Homem-Aranha baseada no clássico herói
da Marvel Comics, Tobey Maguire volta como o gentil Peter Parker, o
jovem que se esforça para manter o delicado equilíbrio
de sua vida dupla, como estudante universitário e como a
criatura super-humana que luta contra o crime. </font></font></font><meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />


	
	
	
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
	--&gt;</style><font color="#000000"><font face="Times New Roman"><font size="3">A
prazerosa aventura torna-se cada vez mais séria, e a vida do
Homem-Aranha ainda mais complicada, quando ele enfrenta um novo
temível adversário, o inteligente Otto Octavius (Alfred
Molina), que ressurge como o maníaco e multi-tentáculos
&quot;Doc Ock&quot;.</font></font></font>

</p>

<p style="margin-bottom: 0cm;" align="justify"><br />
</p>
<br /> 
</p>
<br />
 ', NULL, '2004-08-17', 12, '2004-08-17', '2004-08-20', NULL, NULL, 0, NULL);
 
