do Folclore. A Secretaria de Cultura e Turismo decidiu promover uma
programação diferenciada dentro do projeto Domingo na
Praça. A partir das 15h30 até às 18 horas, sete
grupos de dança e música estarão se apresentando
no local. Informações pelo telefone 529-1054. 
</p>
<p style="margin-bottom: 0cm;" align="justify">


