	--&gt;
	</style>

<p style="margin-bottom: 0cm; font-family: verdana,arial,helvetica,sans-serif;" align="justify">#imagem#<br />Até o dia 31 de
agosto, as artistas plásticas Suzana Sefrin e Cristiane
Wilborn participam da exposição dentro do projeto da
Secretaria de Cultura e Turismo de Sapiranga de valorização
da produção artística. 


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title>
	
	<meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;
	</style>

<p style="margin-bottom: 0cm;" align="justify">Telas e objetos de
decoração podem ser conhecidas na Casa Tombada,
localizada na rua Duque de Caxias, 487, no bairro Centenário.
A visitação pode ser realizada de segunda a
sexta-feira, das 8h30 às 11h30 e das 13h30 às 18h30, na
rua Duque de Caxias, 487. Informações pelo telefone
529-1054.<br /></p><p style="margin-bottom: 0cm;" align="justify">


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	
	
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;
	</style>

<p style="margin-bottom: 0cm;" align="justify">Esta é a primeira
exposição da artista plástica Cristiane Wilborn,
que começar a pintar há três anos. Atualmente,
realiza textura em tela com massa acrílica lisa e textura na
parede com massa texturato, bem como, elaboração de
caixas, decoração para quarto de bebê (completo),
kits de chá e banheiro entre outros objetos decorativos
realizados na técnica folhação e decoupage em
madeira. 


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title>
	
	<meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;</style>Em 2005, a próxima
etapa é montar um ateliêr e iniciar a graduação
em Artes Plásticas.</p><p style="margin-bottom: 0cm;" align="justify">


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	
	
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;
	</style>

<p style="margin-bottom: 0cm;" align="justify">Suzana Sefrin apresenta
uma retrospectativa do trabalho, desde a primeira tela, num total de
36 trabalhos. Desde 1970 até os dias de hoje, é
possível reconhecer o estilo de Suzana, que prefere a pintura
acadêmica. Ela começou a pintar com pincel, depois
passou para espátula e agora está na fase de pintar com
pincel. 


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title>
	
	<meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
	--&gt;</style>O trabalho consiste em
registrar paisagens, natureza morta, figura humana e flores em óleo
sobre tela, textura e acrílico, tanto em tela como em tecido.
Suzana possui um ateliêr de arte e oferece aulas de pintura. 

 
</p>
 

 
</p>
</p>
 
</p>
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
 ', NULL, '2004-08-19', 12, '2004-08-19', '2004-08-23', NULL, NULL, 0, NULL);


	<meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
	
	
	<style>
	&lt;!--
		@page { size: 21cm 29.7cm; margin: 2cm }
		P { margin-bottom: 0.21cm }
