	</style>

<p style="margin-bottom: 0cm; font-family: verdana,arial,helvetica,sans-serif;" align="justify">Nos dias 31 de agosto, 1
e 2 de setembro, o Centro Municipal de Cultura Lúcio Fleck
estará sediando o curso Arte no Boné. A atividade
é realizada pelos artistas grafiteiros Rodrigo Dias Nascimento
e Mauro Ismael. A intenção é mostrar como usar
tinta acrílica para tecido, pincéis e palitos de dente.</p>
<br style="font-family: verdana,arial,helvetica,sans-serif;" />


