<p style="margin-bottom: 0cm; font-family: verdana,arial,helvetica,sans-serif;" align="justify">É uma técnica
para trabalhos mais detalhados, explicam. O participante terá
dois horários para escolher: das 9 às 11h ou das 14 às
16 horas. O participante deverá trazer tinta para tecido
(branca, azul, amarela e vermelha), camiseta, boné, calça
de abrigo, cola tenaz ou fixador e pincel número 1. O
investimento é de R$ 10. Informações pelo
telefone 599-4058</p>
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
