<br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">SINOPSE:Didi trabalha como provador de balas em uma pequena fábrica de doces tradicionais. Com sua alma infantil, ele sabe o que as crianças gostam. Só que a fábrica está passando por dificuldades porque a concorrência utiliza a mídia para vender balas cheias de corantes e ingredientes artificiais que fazem mal às crianças. </font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">O vilão, dono dessa fábrica, costuma dizer que criança só gosta de porcaria mesmo. Didi, que vivi no meio das crianças da vizinhança, tenta convencê-las de que balas artificiais fazem mal.</font>
