<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Os artistas presentes são Evanir Forte, Livelda Krumenauer, Célia Nervo, Cleide Benedetti, Maria Tereza Beilke, Cleci Dorneles, Seila Hartz, Gudrun Stölein, Juliana Blauth, Rejane Ermel, Denise Barbosa, Sissi Foltz, Suelci Fülber, Lia </font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Soares, Ana Alice Gertner, Marion Brochado, Nilda Pavani, Inge Sefrin, Lisete Klein, Adelina Schneider, Fai Nunes de Souza, Therezinha Nunes de Souza, Elida Lunardi, Dione Lunardi e Vera Hoch.<br /><br /></font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Cristina, de 80 anos, é professora de artes há 51 anos. A pintura trabalha com os dois lados do cérebro, o que evita o surgimento de doenças como a de Alzeimer, explica. O ateliêr fica localizado em Novo Hamburgo e têm trabalhos em diversos países, </font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">como Inglaterra, Alemanha, Portugal, Austrália, Estados Unidos, Espanha, México e Itália e faz parte de associações de artistas de Novo Hamburgo e Porto Alegre e do Estado do Rio Grande do Sul. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
