 <font size="1"><font size="3"><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">
 
 A</span></font><span style="font-family: verdana,arial,helvetica,sans-serif;">s escolas Dr. Décio Gomes Pereira e Anita Lydia Wingert promovem cursos de capacitação para seus professores nos próximos quatro meses. Serão três cursos diferentes com o objetivo de de possibilitar a qualificação profissional, além da realização pessoal dos educadores. <br />No dia 11 de setembro, haverá o curso </span><span style="font-style: italic; font-family: verdana,arial,helvetica,sans-serif;">Resgatando a pessoa por trás do professor, pela arte, expressão e movimento</span><span style="font-family: verdana,arial,helvetica,sans-serif;">, ministrado pela professora Korine Sebold Compagnoni, pós graduada em Dançoterapia pela Feevale. Já no dia 02 de outubro, acontece o curso </span><span style="font-style: italic; font-family: verdana,arial,helvetica,sans-serif;">O sucesso escolar através da avaliação e da recuperação</span><span style="font-family: verdana,arial,helvetica,sans-serif;">, com apresentação da prof</span><sup style="text-decoration: underline; font-family: verdana,arial,helvetica,sans-serif;">a</sup><span style="font-family: verdana,arial,helvetica,sans-serif;">. mestre Maria Celina Melchior, da editora Premier. Para fechar a série de cursos, haverá, ainda, o curso </span><span style="font-style: italic; font-family: verdana,arial,helvetica,sans-serif;">Relacionamento Interpessoal</span><span style="font-family: verdana,arial,helvetica,sans-serif;"> do capitão da Brigada Militar, Eduardo Ottonelli Pithan. <br />Todos os cursos serão realizados no auditório da escola Dr. Décio Gomes Pereira. Os professores com 100% de frequência receberão certificados expedidos pela Secretaria Municipal de Educação e Desporto (SEMEC).</span></font><br />   ', NULL, '2004-09-02', 11, '2004-09-02', '2004-09-13', NULL, NULL, NULL, NULL);
 
 
 
 <table rules="none" frame="void" cellspacing="1" cellpadding="1" border="0" style="border-style: none; width: 100%; background-image: none; float: none; text-align: justify; vertical-align: top;"><tbody><tr><td><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;"><font size="3" style="font-weight: bold;">D</font>iretores, coordenadores pedagógicos e Secretários de Educação de
