de Gestão Educacional realizado no Centro Municipal de Cultura Lúcio
Fleck no último dia 30 de agosto. A Secretária de Educação de
Sapiranga, Liane Reichert Klein, falou aos presentes sobre a
implantação da Gestão Municipal e Escolar no município e os resultados
obtidos nos últimos 4 anos.</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;"></span></font> </td><td style="border-style: none; background-image: none; text-align: center; vertical-align: middle;">#imagem#<br /></td></tr><tr><td rowspan="1" colspan="2"><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">A Gestão Municipal e Escolar funciona em parceria com o Instituto
Ayrton Senna, através do Programa Escola Campeã, e a Fundação Banco do
Brasil. A secretária ainda mostrou os outros projetos desenvolvidos,
como a Educação de Jovens e Adultos (EJA) do Programa BB Educar e o
AABB - Comunidade, ambos da Fundação Banco do Brasil.</span></font><font size="1" style="font-family: verdana,arial,helvetica,sans-serif;"><br />Em um segundo momento, foi apresentado o painel intitulado <span style="font-style: italic;">Indicadores para uma Educação de Qualidade</span>, apresentado pela gerência, superintendência e supervisores da SEMEC. Foram enfatizados os seguintes indicadores: <span style="font-style: italic;">Definindo
Metas para um Ensino Eficaz, Correção de Fluxo/Classes de Aceleração de
Aprendizagem, Programa de Alfabetização de Adultos, Política de
Alfabetização e Avaliação Externa.</span> <br />
Finalizando o evento, os convidados assistiram aos Relatos de
Experiências de Sucesso das escolas municipais de ensino fundamental e
educação infantil. Os relatos aconteceram à noite na escola São Carlos.
Além de  profissionais da área de educação, estiveram presentes
conselheiros municipais e escolares e representantes das Associações de
Pais e Mestres (APMs).<br /></font><br /></td></tr></tbody></table><br /><br />    ', 34625, '2004-09-01', 11, '2004-09-01', '2004-09-15', 'Gestao Educacional.jpg', 'Izabela Backes', NULL, NULL);
 
 
 
 
 
 
 
 
 <span style="font-family: verdana,arial,helvetica,sans-serif;"><font size="3"><span style="font-weight: bold;"><table rules="none" frame="void" border="0" style="border-style: none; width: 100%; background-image: none; float: none; text-align: justify; vertical-align: top;"><tbody><tr><td colspan="1" rowspan="1"><span style="font-family: verdana,arial,helvetica,sans-serif;"><font size="3"><span style="font-weight: bold;">P</span></font><font size="1">rofessores
