Campeonato Municipal começa no domingo', '<span style="font-family: verdana,arial,helvetica,sans-serif;"><span style="font-weight: bold; color: rgb(204, 0, 0);">ESPORTE</span><br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">As equipes da Chave B abrem o Campeonato Municipal de Futebol de Sapiranga neste domingo (19). Os jogos estarão sendo realizados nos campos do Centenário, Lígia e Ireno, às 9h30 (Veteranos), 13h30 (2º Quadro) e 15h30 (1º Quadro). No domingo (26), as equipes da Chave A estarão em campo. Segundo o Departamento Municipal de Desporto, ao todo, são 39 equipes divididas em três categorias, disputando jogos até dezembro nos campos municipais. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">A primeira rodada terá jogos de Gondoleiros x Nova Aurora, no campo do Centenário; Juventude x Boca Júnior no campo do Lígia e São Francisco x Vasco, no campo do Ireno. A grade vale para as categorias Veteranos (9h30), 2º Quadro (13h30) e 1º Quadro (15h30). </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
 ', NULL, '2004-09-16', 12, '2004-09-16', '2004-09-20', NULL, NULL, 0, NULL);
 <span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA<br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><font style="font-family: verdana,arial,helvetica,sans-serif;" size="3">Para integrar a comunidade e valorizar os talentos da região, o projeto Domingo na Praça continua a ser realizado na Praça da Bandeira de Sapiranga. Neste domingo (26), a programação fica por conta da Escola de Samba Unidos de Sapiranga. <br /><br />A partir das 17 horas, haverá a apresentação da Rainha da escola, da Madrinha da bateria, além do casal de Mestre Sala e Porta-Bandeira, da Ala das Crianças e dos Destaques dos carros alegóricos, entre outros. Às 18 horas os componentes da escola realizam um show de pagode. Informações junto à Secretaria de Cultura e Turismo, no telefone 529-1054. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
