 <span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Um camponês obrigado a tornar-se médico para salvar a filha do Rei e que a partir daí torna-se o médico mais sábio do Reino, é a história da comédia infantil A Princesa Engasgada, do Grupo Farsa e direção de Gilberto Fonseca. A peça será apresentada à Sapiranga na quinta-feira (14), em quatro horários: 8h, 9h30, 14h e 15 horas, no Centro Municipal de Cultura Lúcio Fleck (rua Sete de Setembro, 766). Ingressos a R$ 2,00. Informações pelo telefone 599-4058. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
