 <font size="1"><font size="3"><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">O</span></font><span style="font-family: verdana,arial,helvetica,sans-serif;"> curso </span><span style="font-style: italic; font-family: verdana,arial,helvetica,sans-serif;">&quot;Criança: uma intersecção possível entre a clínica psicanalítica e a escola&quot;</span><span style="font-family: verdana,arial,helvetica,sans-serif;"> terá sua terceira e última etapa no dia 28, no auditório da Secretaria Municipal de Educação e Desporto (SEMEC). Ministrado pela psicóloga e psicanalista Tamara Steren dos Santos, o curso é voltado </span></font>para coordenadores pedagógicos, diretores de escolas, profissionais da APAE e demais colegas da SEMEC. <br />O objetivo é a reflexão e estudo sobre o campo das patologias nas crianças e suas manifestações no cotidiano da escola. A iniciativa de trazer o curso para Sapiranga foi da psicopedagoga Márcia Magali Pressi, profissional da Secretaria de Educação e Desporto. As outras etapas foram realizadas nos dias 14 e 21 de setembro.<br /> ', NULL, '2004-09-23', 11, '2004-09-23', '2004-09-29', NULL, NULL, NULL, NULL);
