 <span style="font-family: verdana,arial,helvetica,sans-serif;"><span style="font-weight: bold; color: rgb(204, 0, 0);">LAZER</span><br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><font style="font-family: verdana,arial,helvetica,sans-serif;" size="3">Estréia neste sábado (26) a comédia Shrek 2, no Centro Municipal de Cultura Lúcio Fleck, em Sapiranga. Serão seis sessões para a comunidade, além de outras seis sessões destinadas para as escolas. A comédia infantil dá continuidade à história de Shrek (Mike Myers), um ogro que vive um casamento feliz com a Princesa Fiona (Cameron Diaz) no pântano. A situação se complica quando os pais de Fiona descobrem que ela não se casou com o Príncipe (Rupert Everett) e por isso enviam o Gato de Botas (Antonio Banderas) para separar o casal. Ingressos a R$ 5,00 e R$ 3,00. Informações pelo telefone 599-4058. <br /><br /></font><font style="font-family: verdana,arial,helvetica,sans-serif;" size="3"><b>As sessões: </b></font><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
2 e 3/10  20h30</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
5 e 6/10  só para escolas  9h e 14h</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
9, 10 e 11/10  20h30 </span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
12/10  16 horas </span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
13/10  só para escolas - 9h e 14h</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
<font style="font-family: verdana,arial,helvetica,sans-serif;" size="3"><b>Sinopse:</b></font><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
Após se casar com a Princesa Fiona (Cameron Diaz), Shrek (Mike Myers) vive feliz em seu pântano. Ao retornar de sua lua-de-mel Fiona recebe uma carta de seus pais, que não sabem que ela agora é um ogro, convidando-a para um jantar juntamente com seu grande amor, na intenção de conhecê-lo. A muito custo Fiona consegue convencer Shrek a ir visitá-los, tendo ainda a companhia do Burro (Eddie Murphy). Porém os problemas começam quando os pais de Fiona descobrem que ela não se casou com o Príncipe (Rupert Everett), a quem havia sido prometida, e enviam o Gato de Botas (Antonio Banderas) para separá-los.
</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
  ', NULL, '2004-10-06', 3, '2004-09-28', '2004-10-06', NULL, NULL, 0, NULL);
