Spring Summer é moda e solidariedade', '<span style="font-family: verdana,arial,helvetica,sans-serif;"><span style="font-weight: bold; color: rgb(204, 0, 0);">GERAL</span><br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Nesta sexta-feira (1º), ocorrerá a Spring Summer 2005 na Vib Danceteria (Clube 19 de Julho), às 20h30. O ingresso pode ser adquirido a R$ 6,00 (antecipado) e R$ 9,00 (na hora). Parte dos recursos será revertido para a compra de alimentos às famílias carentes do município. Haverá desfile de lançamento da coleção Primavera-Verão das lojas D''Noras, Via Modas e Style, com maquiagem de O Boticário e penteados de Scalcon Cabelereira. A banda Single fará o show da noite. Informações pelo telefone 599-2247.</font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
