 <span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">ESPORTE</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font style="font-family: verdana,arial,helvetica,sans-serif;" size="3">Um sapiranguense estará representando o Rio Grande do Sul no Campeonato Brasileiro de Triathlon Infantil e Infanto-Juvenil, na cidade de Fortaleza, no Ceará. No próximo sábado (9), o atleta João Luiz Ceccatto (Fandreis/Micropint/ Ágil Soft), da Equipe de Triathlon de Sapiranga (Etrisa/Senso) participará do evento, com apoio da prefeitura de Sapiranga. Ceccatto precisará nadar 750 metros, pedalar mais 20 quilômetros e correr cinco quilômetros, num total de 25.750 metros a serem percorridos, pela categoria 14-15 anos de idade.</font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" />
  ', NULL, '2004-10-06', 3, '2004-10-04', '2004-10-06', NULL, NULL, 0, NULL);
 <span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">GERAL</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Os moradores de Sapiranga estão sendo orientados a utilizar material removível para a pavimentação do passeio público. Segundo a secretária de Planejamento Rosane Reichert, as calçadas novas devem ser pavimentadas com bloquete de concreto, laje de gres, entre outros materiais que sejam de fácil retirada. <br /><br />Isso porque futuramente serão implantadas novas redes de água e de esgoto cloacal na cidade, o que irá exigir a retirada dos passeios públicos para a instalação. A solicitação é feita somente para as novas calçadas que estão sendo feitas pelos moradores. Informações pelo telefone 599-4499, ramal 242. </span>
  ', NULL, '2004-10-06', 3, '2004-10-04', '2004-10-06', NULL, NULL, 0, NULL);
Cartões postais em prol da Apada', '
 <span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">GERAL</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Cartões postais com desenhos de Sapiranga estão sendo comercializados pela Associação de Pais e Amigos dos Deficientes Auditivos (Apada). Tudo começou com uma mobilização do Conselho Municipal dos Direitos da Criança e do Adolescente (Comdica), que convidou alunos da Educação Infantil ao Ensino Médio a participarem do projeto Arte Solidária. <br /><br />Na segunda-feira (27), 32 mil unidades foram entregues pela presidente do conselho, Gissela Schein, ao presidente da Apada, Fernando Hanauer. O cartão postal está à disposição da comunidade, a R$ 0,50 cada, e pode ser encontrado na Escola Luterana São Mateus, e em breve nas livrarias da cidade e durante a Festa das Rosas, em novembro. O cartão possui 14 x 10 centímetros, em papel couchê 250 gramas e colorido. Informações pelo telefone 599-2777, com Gissela. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Resolvemos nos engajar ao desafio lançado pelo prefeito Renato Molling na campanha de arrecadação de recursos para a construção do prédio da Apada, explica. Segundo Gissela, os estudantes enviaram o trabalho para o conselho, sendo 32 selecionados. Os cartões ilustram paisagens, rosas, a Praça da Bandeira, a Casa Tombada e releituras de telas da artista plástica Tania Hanauer, entre outros. <br /><br />Gissela destaca que o material resgata a auto-estima da criança, ao mesmo tempo em que o estudante doa criatividade em prol de uma ação solidária. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
  ', NULL, '2004-10-06', 3, '2004-10-04', '2004-10-06', NULL, NULL, 0, NULL);
 
 <div style="text-align: justify;"><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;"><font size="2" style="font-weight: bold;">    O</font> Núcleo Sapiranga da Fundação Tênis, criado em 15 de março deste ano no município, já é um sucesso. O grupo de 20 crianças da Escola Municipal de Ensino Fundamental 28 de Fevereiro, que começou o aprendizado do tênis no começo do ano, cresceu. Atualmente já são 90 meninos e meninas, entre 8 e 12 anos, que recebem aulas de tênis no Parque Municipal do Imgrante, naquele município. </span></font><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">    O trabalho, coordenado por Haroldo Zwetsch, já rendeu bons resultados. Na quadra, a turma, sob orientação do professor Carlos Eduardo Lenz e do monitor André Werb, vai aos poucos se familiarizando com os fundamentos do esporte. O clima de companheirismo predomina entre os jovens alunos nas aulas realizadas duas vezes por semana, às terças e às quintas-feiras. &quot;As crianças estão mais amigas e demonstram maior confiança no nosso projeto&quot;, diz o coordenador. </span></font><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">    Orgulhoso do trabalho no Núcleo Sapiranga da Fundação Tênis, Haroldo destaca a importância do trabalho: &quot;As crianças valorizam  muito este momento das aulas de tênis, elas contam nos dedos as horas que faltam para ir ao Parque&quot;. A Fundação Tênis desenvolve as escolinhas em diversas cidades. Para conhecer mais sobre a a Fundação, o endereço do site na internet é <span style="text-decoration: underline;">www.fundacaotenis.org.br</span>.</span></font><br />    </div> ', NULL, '2004-10-05', 11, '2004-10-05', '2004-10-31', NULL, NULL, NULL, NULL);
 <span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA<br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><font style="font-family: verdana,arial,helvetica,sans-serif;" size="3">No dia 15, às 19 horas, a Sociedade Literária de Sapiranga estará retomando a edição do Sarau Literário. A atividade ocorrerá no CTG Galpão Sentinela do Pago (av. 20 de Setembro, 7980, no bairro Amaral Ribeiro). Além da leitura de poesias, contos e trechos de obras literárias, o grupo irá oferecer um carreteiro, a R$ 5,00. A inscrição de pessoas interessadas em fazer uma apresentação deve ser feita antecipadamente, junto à Secretaria da Cultura e Turismo, localizada na rua Duque de Caxias, 487. Estão confirmadas a presença de poetas de Novo Hamburgo e São Leopoldo. Informações pelo telefone 529-1054. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
  ', NULL, '2004-10-06', 3, '2004-09-29', '2004-10-06', NULL, NULL, 0, NULL);
 
 
 
 <div style="text-align: justify;"><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;"><font size="2"><span style="font-weight: bold;">    O</span> </font>poeta sapiranguense Jairo Brum Gomes compôs um poema em homenagem à V edição do Festival Municipal Artístico Escolar (FEMAE), que ocorre de 25 a 30 de outubro. Confira abaixo o poema:</span></font><br style="font-family: verdana,arial,helvetica,sans-serif;" /></div><div style="text-align: center;"><font size="1"><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Chegando o V FEMAE,</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Vá preparando a garganta</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Para quem dança, declama ou canta</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Chegou a oportunidade.</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Sua participação, na verdade,</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Será de grande importância...</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Você será a fragrância</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Da rosa desta cidade.</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">De 25 a 30 de outubro,</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Acontecerá este evento.</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">E você, que tem talento,</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Sinta-se convidado.</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Quem estuda e é dedicado</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Consegue notas boas,</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Muda a opinião das pessoas</span><br style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">E é sempre valorizado.</span></font><br style="font-weight: bold;" /></div><br style="font-weight: bold;" /><br />
     ', NULL, '2004-10-06', 11, '2004-10-05', '2004-10-31', NULL, NULL, NULL, NULL);
 
 
 
 
 
 
 
 
 <div style="text-align: justify;"><span style="font-family: verdana,arial,helvetica,sans-serif;"></span><span style="font-family: verdana,arial,helvetica,sans-serif;"></span><span style="font-family: verdana,arial,helvetica,sans-serif;"><font size="2"><span style="font-weight: bold;">         O</span></font><font size="1">
município de Sapiranga já conta com o Centro Municipal de Estudos
Ambientais, voltado para a coordenação dos diversos projetos de
educação ambiental existentes, e outros a serem implantados. É uma
estrutura criada pelo município através do FUNDEF (Fundo de
Desenvolvimento e Manutenção do Ensino Fundamental e Valorização do
Magistério) com a supervisão da SEMEC. </font></span><br /><span style="font-family: verdana,arial,helvetica,sans-serif;"><font size="1">    Atualmente atende alunos, num
projeto piloto, da escola Anita
Lydia Wingert em turnos opostos às aulas. A partir de 2005,
atenderá toda a rede escolar. O Centro de Estudos Ambientais está
localizado na Rua São Jacó, 2741, bairro São Paulo.</font></span><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">&nbsp;</span></font><br /><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">    Para
incrementar as atividades do Centro, a Prefeitura Municipal está
estabelecendo uma parceria com a FEEVALE, que oferecerá cursos e
pesquisas nas áreas de conhecimento técnico para alunos e professores
da rede muncipal de ensino, assim como para produtores rurais da
região. Pelo convênio, a universidade colocará à disposição
profissionais da área - como veterinários, biólogos, pedagogos,
engenheiros de produção. Cada profissional atuará com carga horária de
24 horas semanais cada um.</span></font><span style="font-family: verdana,arial,helvetica,sans-serif;"><font size="2"><span style="font-weight: bold;"></span></font></span></div><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">&nbsp;</span></font>             ', 35160, '2004-10-05', 11, '2004-09-22', '2004-10-23', 'centro_ambiental.jpg', NULL, NULL, NULL);
 ', NULL, '2004-10-05', 12, '2004-10-05', '2004-10-13', NULL, NULL, 0, NULL);
