 <div style="text-align: justify;"><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;"><font size="3" style="font-weight: bold;"><font size="2">            O</font><font size="1">&nbsp;</font></font>V Festival Municipal Artístico Escolar (FEMAE), que acontece de 25 a 30 de outubro no Centro Municipal de Cultura Lúcio Fleck, está com as inscrições abertas até o dia 14. No evento, os participantes mostram suas habilidades em diversas modalidades como danças, música, poesia, leitura e esquete. </span></font><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">        O FEMAE contará com quatro categorias: alunos de 1</span><sup style="font-family: verdana,arial,helvetica,sans-serif;">a</sup><span style="font-family: verdana,arial,helvetica,sans-serif;"> a 4</span><sup style="font-family: verdana,arial,helvetica,sans-serif;">a</sup><span style="font-family: verdana,arial,helvetica,sans-serif;"> série, de 5</span><sup style="font-family: verdana,arial,helvetica,sans-serif;">a</sup><span style="font-family: verdana,arial,helvetica,sans-serif;"> a 8</span><sup style="font-family: verdana,arial,helvetica,sans-serif;">a</sup><span style="font-family: verdana,arial,helvetica,sans-serif;"> série, alunos do Ensino Médio e Ensino Noturno e Misto. A três primeiras são para alunos matriculados na mesma escola, enquanto que a categoria Misto é para grupos formados por representantes das outras categorias, podendo, inclusive, estarem matriculados em escolas distintas. </span></font><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">        Os alunos premiados serão convidados para realizar uma nova apresentação nas noites de 17 e 18 de novembro. Maiores informações na Secretaria Municipal de Educação e Desporto (SEMEC) pelo telefone 599-1891. </span></font><br style="font-family: verdana,arial,helvetica,sans-serif;" /></div><br />
     ', NULL, '2004-10-06', 11, '2004-10-05', '2004-10-14', NULL, NULL, NULL, NULL);
