<font style="font-family: verdana,arial,helvetica,sans-serif;" size="3"><b>1 e 2º Quadro  </b></font><span style="font-family: verdana,arial,helvetica,sans-serif;">Juventude x Vasco (Lígia), Estrela x Boca Júnior (Sesi), Gondoleiros x São Francisco (Centenário).
