 <span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">SAÚDE</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />


	
	
	
	

<p style="margin-bottom: 0cm; font-family: verdana,arial,helvetica,sans-serif;" align="justify"><font size="3">Até o
final do ano, será formada uma associação de
usuários de medicamentos especiais em Sapiranga. A decisão
foi tomada em reunião promovida pela Farmácia Municipal
de Saúde do município, ontem (5), junto à
Secretaria de Saúde.</font></p>



	
	
	
	

<p style="margin-bottom: 0cm; font-family: verdana,arial,helvetica,sans-serif;" align="justify"><font size="3">Segundo o
farmacêutico Emerson Leite, os usuários estão
dispostos a formar a associação a fim de obter maior
representatividade junto à Secretaria de Saúde do
Estado, caso venha a faltar medicamentos de alto custo. Entregamos
um modelo prévio de um estatuto para que possa ser analisado
pelo grupo. A expectativa é formar a associação
até a segunda quinzena de novembro, antecipa.<br /></font></p><p style="margin-bottom: 0cm; font-family: verdana,arial,helvetica,sans-serif;" align="justify">&nbsp;</p><p style="margin-bottom: 0cm;" align="justify"><font size="3"><span style="font-family: verdana,arial,helvetica,sans-serif;">A reunião
também formalizou a criação do Banco de
Medicamentos, a ser controlado pela farmácia, e que irá
suprir temporariamente a necessidade do usuário com o auxílio
das demais pessoas. Mais informações sobre a adesão
ao grupo podem ser obtidas pelo telefone 599-3932.</span> </font>
</p>

<p>
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" />
   </p>', NULL, '2004-10-06', 3, '2004-10-06', '2004-10-06', NULL, NULL, 0, NULL);
Cinema de Sapiranga', '<font size="3"><span style="font-weight: bold; color: rgb(204, 0, 0);">LAZER</span><br /><br />Shrek 2 continua em cartaz no Centro Municipal de Cultura Lúcio Fleck, em Sapiranga. As sessões reservadas para a comunidade são no sábado, domingo e segunda-feira (9, 10 e 11), às 20h30 e no feriado da terça-feira (12), às 16 horas. Também estão sendo realizadas sessões destinadas para as escolas. <br /><br />A comédia infantil dá continuidade à história de Shrek (Mike Myers), um ogro que vive um casamento feliz no pântano com a Princesa Fiona (Cameron Diaz) até o momento em que os pais de Fiona tentam impedir a felicidade do casal por meio do Gato de Botas (Antonio Banderas). Ingressos a R$ 5,00 e R$ 3,00 para estudantes. Informações pelo telefone 599-4058. </font>', NULL, '2004-10-06', 12, '2004-10-06', '2004-10-13', NULL, NULL, 0, NULL);
