<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
Das 13h30 às 15 horas, em conjunto com a Polícia Rodoviária Estadual e Agentes Mirins, haverá orientação aos motoristas que transitam na RS-239. Após, das 15h30 às 17 horas, a Guarda de Trânsito com apoio da Brigada Militar estará realizando uma blitz no perímetro urbano, a fim de verificar a documentação do motorista e do veículo, bem como as condições do veículo, como lacre da placa, parte elétrica e equipamentos. A mesma ação ocorrerá das 18 às 20 horas. A ação será realizada em todo o Estado. Informações pelo telefone 599-4499 ramal 249. 
</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Em reunião com o Governo do Estado e o Movimento Gaúcho para o Trânsito Seguro (MGTS), na Federação das Associações dos Municípios do Rio Grande do Sul (Famurs), no dia 26, todos os municípios são orientados para promover uma fiscalização mais rigorosa. Os dados apontam que somente com fiscalização obtém-se um resultado mais imediato, explica o coordenador do MGTS Ricardo Schiavon. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
A intenção é reduzir os índices de acidentes ocorridos, principalmente nos períodos em que há um intenso fluxo de veículos se deslocando para o veraneio. Sapiranga é um dos poucos municípios a unir a educação no trânsito, explica Schiavon, também autoridade de trânsito de Sapiranga. 
</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
