Dia do Desafio 2005 ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">GERAL</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="5" color="#000080" style="font-family: verdana,arial,helvetica,sans-serif;"><b>Sapiranguense se prepara para o <br />
Dia do Desafio 2005 escrevendo mensagens<br /><br /></b></font><span style="font-family: verdana,arial,helvetica,sans-serif;">Deus compreende nossas lutas emocionais mais profundas. Dia do Desafio, 25/05/05. Esta mensagem foi escrita numa cartolina de tamanho 5 x 10 centímetros, à próprio punho, pela professora aposentada Nelcila Braun Ermel, de 77 anos. Até o dia de ontem (6), a sapiranguense havia escrito mil cartões, com frases retiradas de livros ou de sua autoria. Entendo que o Dia do Desafio ocorre diariamente. O objetivo é oferecer as mensagens no ano que vem e espera produzir mais de 2 mil mensagens.</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A rotina da dona Nelcila mudou desde 1997, primeiro ano em que Sapiranga aderiu ao evento internacional, promovido no Brasil pelo Serviço Social do Comércio (Sesc). A partir de então, ela vem elaborando mensagens do bem viver para distribuir junto à comunidade. Se em 1997 foram confeccionadas 184 mensagens, em 2004 foram somadas 2.000. Para comprovar, Nelcila tem um controle dos locais onde entregou. <br /><br /></font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A cartolina ela ganha do sobrinho, que trabalha numa gráfica. Mesmo com a mão trêmula, escreve em média, 20 mensagens por dia, sem utilizar régua. Anualmente, ela visita o comércio, os amigos e escolas para entregar a mensagem. Alguns me mostram que guardam na carteira. As crianças também me contam que entregam para os pais. É uma atividade que dá muita satisfação. Em 2005, a exemplo da amiga Gládis Klein, ela pretende oferecer para as pessoas que circulam pelas ruas, para atingir ainda mais pessoas. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
 ', NULL, '2004-10-07', 12, '2004-10-07', '2004-10-18', NULL, NULL, 0, NULL);
Inscrições para exame supletivo ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">EDUCAÇÃO<br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">A Secretaria de Educação e Desporto de Sapiranga estará realizando os Exames Supletivos do Ensino Fundamental. As inscrições ocorrem a partir da próxima segunda-feira (18) até a sexta-feira (22), no Centro Municipal de Educação Dr. Décio Gomes Pereira, localizado na avenida Presidente Kennedy, 2222, no bairro São Luiz. As provas habilitam a pessoa com idade superior aos 15 anos a obter o certificação de conclusão do Ensino Fundamental. A inscrição é gratuita. As provas vão ocorrer de 29 de novembro a 4 de dezembro. Informações pelo telefone 599-1891.</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
Os documentos necessários para a inscrição são uma foto 3 x 4 atual e um documento de identidade no caso do candidato que já fez os exames. A pessoa que vai fazer o exame pela primeira vez deve apresentar cópia e original do documento de identidade, duas fotos 3 x 4 iguais e sem uso, comprovante de residência em Sapiranga, histórico escolar ou atestado de escolaridade que comprove a conclusão do segmento anterior. 
</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
 ', NULL, '2004-10-13', 12, '2004-10-13', '2004-10-19', NULL, NULL, 0, NULL);
<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><br />
<b>Sinopse:</b></font><span style="font-family: verdana,arial,helvetica,sans-serif;">&quot;Irmãos de Fé&quot; conta uma história do nascimento da igreja, e outra do renascimento de um menino. Uma das histórias do filme acontece há dois mil anos e mostra a trajetória de um homem Paulo que foi perseguidor de cristãos e acabou tornando-se um dos seus maiores santos. Ao mesmo tempo em que apresenta a sabedoria de um outro Pedro que soube reconhecer o novo e fazer a ponte entre o passado e o futuro. A outra história se passa na São Paulo de hoje, na Febem, e mostra o encontro entre um homem de Fé, o Padre Marcelo, e um marginal, o adolescente Paulo. Um encontro que começa marcado pela violência de um seqüestro relâmpago e se torna um caminho em direção a liberdade e à esperança.
</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
