do Centro de Cultura Lúcio Fleck<br /><br /></b></font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A partir da próxima segunda-feira (18) até dia 28 de outubro, o artista plástico Fabiano Silveira apresenta a exposição <i>Estupidez Humana I/VII</i></font><span style="font-family: verdana,arial,helvetica,sans-serif;">no Centro Municipal de Cultura Lúcio Fleck, em Sapiranga. Trata-se de uma série de sete trabalhos, em painéis e instalações, mostrando a violência. Por isso, o preto e o vermelho estão presentes na maioria dos trabalhos. A intenção é promover uma conscientização individual de quem vê o trabalho assim como uma reflexão do quanto cada um contribui para a violência, explica. 
</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Professor de projetos especiais e de Educação Artística, o artista convidou os estudantes interessados em produzir um trabalho para participar da exposição. O aluno da Educação de Jovens e Adultos Márcio Wagner, da escola municipal Pastor Rodolfo Saenger, aceitou o desafio e apresenta por meio de bonecas e trabalhos em argila cenas da violência urbana. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Os trabalhos foram feitos com tinta têmpera. Quase sempre utilizamos o material com as crianças. Me permiti fazer um desabafo infantil, um pedido de basta violência!. Na avaliação de Silveira, a arte contemporânea nem sempre é compreendida, mas também é reflexo do que está acontecendo na sociedade. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A exposição vem a mostrar o meu sofrimento com a realidade. Foi um sofrer junto com a obra. A violência exposta no jornal e na televisão me fez querer desabafar e refletir sobre o que as pessoas estão vivenciando, conta. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">O processo de pesquisa e de transformação do artista também fazem parte da exposição. A exposição mostra a cara e o coração do artista. Me desliguei da estética. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
A visitação pode ser feita de segunda a sexta-feira, das 8 às 11h30 e das 12h30 até 22h e nos sábado e domingos, quando há atividades na casa, que fica localizada na rua Sete de Setembro, 766. Informações pelo telefone 599-4058. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Fabiano Silveira, 30 anos, é artista plástico desde 1994. Está realizando um estudo científico como voluntário no presídio de Novo Hamburgo. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" />
 ', NULL, '2004-10-15', 12, '2004-10-15', '2004-10-23', NULL, NULL, 0, NULL);
Casa do Agricultor inaugura no dia 23', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">AGRICULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" color="#000080" style="font-family: verdana,arial,helvetica,sans-serif;"><b>Associação de agricultores e Prefeitura estarão oferecendo <br />
nova opção para moradores e turistas</b></font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Schmier, kässchmier, nata, ,mel, frutas, leite, queijo, ovos, galinha caipira, spritzbier, feijão, aipim, massa caseira, embutidos, bolachas, torta, cuca, pão integral, roseiras, carvão e artesanato serão alguns dos produtos que a comunidade e os turistas poderão adquirir na Casa do Agricultor de Sapiranga. A nova opção será inaugurada no dia 23 de outubro, às 14 horas, localizado na RS-239, 2030. O prédio foi construído pela prefeitura e será utilizado pela Associação da Casa do Agricultor de Sapiranga (Acasa), formada por 34 sócios-fundadores. O atendimento será nas sextas-feiras, sábados e domingos, das 9 às 20 horas. <br /><br /></font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A obra é constituída de salão de vendas, câmara fria, lancheria, depósitos e sanitários, praça de brinquedos e estacionamento, numa área de 319,70 metros quadrados. Além da Feira do Agricultor, será possível adquirir os produtos com marca própria da associação que foi formada, explica o prefeito Renato Molling. Os produtores estão envolvidos com a abertura da Casa do Agricultor, obra entregue pela prefeitura a fim de incentivar a produção dos alimentos cultivados pelos agricultores. <br />
<br />
O acesso para quem vem de Campo Bom será por baixo do viaduto da avenida Presidente Kennedy, tendo que seguir pela avenida Antão de Farias e na rua Barão do Gravataí. O mesmo acesso pode ser utilizado pelos moradores de Sapiranga. As pessoas que se deslocam de Taquara em direção à Sapiranga, têm acesso direto. Haverá placas sinalizadoras do acesso. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
 ', NULL, '2004-10-15', 12, '2004-10-15', '2004-10-23', NULL, NULL, 0, NULL);
<font size="5" color="#000080">Sapiranga muda sentido de rua para reduzir riscos de acidentes<br /><br /></font></b><span style="font-family: verdana,arial,helvetica,sans-serif;">A Secretaria de Transportes e Trânsito de Sapiranga informa que a rua Alcindo Guanabara, no bairro Santa Fé, sofrerá mudança de trânsito. A partir da sexta-feira (22), a via será transformada em mão única no sentido RS-239-rua Borges Medeiros (do norte para o sul). Dessa forma, somente os veículos que vêm da rodovia estadual poderão acessar a rua Alcindo Guanabara em direção ao bairro. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A alteração é motivada para evitar acidentes de trânsito uma vez que alguns motoristas utilizavam a via para ter acesso ao viaduto da rua Alberto Bins, em direção ao centro, exigindo que o veículo percorresse alguns metros da rodovia na contramão. Informações pelo telefone 599-4499, ramal 251. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
 ', NULL, '2004-10-18', 12, '2004-10-18', '2004-10-23', NULL, NULL, 0, NULL);
<font size="5" color="#000080">Estorinhas infantis reforçam importância das frutas e verduras <br />
na Semana da Alimentação em Sapiranga</font></b><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
Um teatro de fantoches está apresentando as vantagens do consumo de frutas e verduras em Sapiranga. A nutricionista Gianne de Azambuja e as voluntárias Domênica Libardi e Tanara Stumpf Trenz, com apoio da auxiliar de enfermagem Margareth Volkweis, estão apresentando uma peça de teatro de fantoches nos postos de saúde.</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Durante 15 minutos aproximadamente, a história de Chapeuzinho Vermelho é contada com novas informações. O objetivo, explica a nutricionista, é divulgar as informações de forma mais lúdica. A atividade comemora o Dia Mundial da Alimentação, em 16 de outubro. Informações pelo telefone 599-3932. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
Um diálogo entre Chapeuzinho Vermelho e Lobo Mau fala da importância das frutas e verduras. O lobo pergunta para a menina o que tem na cesta. Ela conta que está levando os alimentos para a vovó, que está doente. O lobo tenta roubá-la e consumir as frutas e verduras para ficar forte e saudável. O lobo revela que come de vez em quando salgadinhos e bolachas recheadas, pois sabe que pode ficar fraco. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Depois do teatro, a equipe da saúde faz brincadeiras com as crianças relacionadas com o tema. As mães são orientadas para garantir a alimentação dos filhos, para fazer a pesagem e a medição do crescimento das crianças. Também lembra que a consulta com a nutricionista não requer o encaminhamento médico, basta se inscrever no grupo.</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
Os fantoches foram emprestados pela escola municipal de Educação Infantil Chapeuzinho Vermelho. A intenção é confeccionar o material para a secretaria de Saúde. Temos diversas outras datas e ações que podem ser aproveitadas com este material, explica Gianne. 
</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><b>Agenda:</b></font><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
