<font size="5" color="#000080">Sapiranga está com inscrições abertas para <br />
provas do Supletivo do Ensino Fundamental </font></b><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
Os sapiranguenses interessados em realizar os exames supletivos do Ensino Fundamental têm esta semana para providenciar a inscrição. O período para garantir o direito de fazer a prova começa nesta segunda-feira (18) e segue até sexta-feira (22), no Centro Municipal de Educação Dr. Décio Gomes Pereira, localizado na avenida Presidente Kennedy, 2222, no bairro São Luiz, das 17h30 às 20h30. A inscrição é gratuita. O benefício é válido somente para as pessoas que residem em Sapiranga. De acordo com a Secretaria de Educação e Desporto, a aprovação nas provas garante a obtenção do Certificado de Conclusão do Ensino Fundamental. Informações pelo telefone 599-1891. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Os documentos necessários para a inscrição são uma foto 3 x 4 atual e um documento de identidade no caso do candidato que já fez os exames. A pessoa que vai fazer o exame pela primeira vez deve apresentar cópia e original do documento de identidade, duas fotos 3 x 4 iguais e sem uso, comprovante de residência em Sapiranga, histórico escolar ou atestado de escolaridade que comprove a conclusão do segmento anterior. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><b>Datas e horários das provas:</b></font><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
29/11  19 às 22 horas  Língua Portuguesa e Ensino Globalizado (primeira a quarta série)</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
30/11  19 às 22 horas  Geografia</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
01/12  19 às 22 horas  Matemática</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
02/12  19 às 22 horas  História</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
03/12  19 às 22 horas  Ciências</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
04/12  08 às 11 horas  Língua Estrangeira (opcional)</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
