Alimentos são doados à Assistência Social ', '<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><span style="font-weight: bold; color: rgb(204, 0, 0);">ASSISTÊNCIA</span><br /><br />A Secretaria de Assistência Social obteve 682 quilos de alimentos não-perecíveis na comemoração dos dois anos de criação da Rádio Harmonia 105.9 FM, de Sapiranga. Na quinta-feira (14), o diretor da rádio, João Ponti, realizou a entrega da doação feita pela comunidade que prestigiou o evento, no Ginásio Municipal de Esportes Nenezão. A titular da pasta, Andréa Haag Ferreira, e a equipe que trabalharam na noite festiva, agradecem a parceria, o que irá permitir o repasse às famílias cadastradas na secretaria. <br />
