<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
O pavilhão da Cultura terá 600 metros quadrados de área, arquibancadas e palco para apresentações. O pavilhão de baile e de gastronomia terá 2 mil m² de área, dotado com mesas, cadeiras e arquibancadas de descanso. O palco de shows terá 1.500 m² de cobertura, com capacidade para acolher seis mil pessoas. A Exposição Feira Indústria e Comércio ficará em espaço coberto com 900 metros quadrados de área. Todos os pavilhões receberão equipamentos de sonorização e de iluminação, a fim de garantir maior qualidade nas apresentações. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A Festa das Rosas ocorrerá dias 6, 7, 13, 14 e 15 de novembro. Os portões do Parque do Imigrante, que possui 8,4 hectares de área, estarão abertos a partir do meio-dia. Os ingressos custarão R$ 3,00 e crianças com até dez anos de idade estão isentas. Informações junto ao Departamento de Turismo, pelo telefone 599-1127. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
 ', NULL, '2004-10-19', 12, '2004-10-19', '2004-10-22', NULL, NULL, 0, NULL);
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
Segundo a coordenadora do evento, Ana Lúcia Silveira, são produções que foram feitas na sala de aula. O objetivo é justamente valorizar aquilo que o professor constrói com o aluno, bem como estimular a criatividade, aprimorar as técnicas e o intercâmbio de experiências. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
A quinta edição contará com 84 apresentações. Serão 15 esquetes, 15 espetáculos musicais, 8 declamações de poesias, 8 leituras, 30 apresentações de dança criativa, 4 apresentações de dança folclórica e 4 apresentações de dança mista. Durante todos os dias, haverá shows de convidados especiais. 
</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Nos dias 17 e 18 de novembro, ocorrerá a noite de apresentação dos espetáculos premiados por uma comissão julgadora. Todos os participantes irão receber certificado de participação. Os primeiros colocados receberão como prêmio um ingresso a uma apresentação artística (a definir) e os segundos e terceiros lugares irão participar de oficinas. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
Para garantir uma completa vivência de um espetáculo, o festival pede que cada grupo se envolva com a criação do espetáculo até a parte de produção. As trilhas sonoras, iluminação, a cenografia e outros detalhes deverão ser observados pelos estudantes. 
</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><b>A programação: </b></font><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
