do Domingo', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">O próximo domingo (24), a Praça da Bandeira de Sapiranga estará garantindo o entretenimento do público a partir das 14 horas. Haverá show de dança, de rap, arte do grafite, um campeonato de skate e um show com a banda Código de Barras, às 18 horas. A entrada é franca. Informações junto à Secretaria de Cultura e Turismo, pelo telefone 529-1054.</font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">O show de dança fica por conta dos grupos Style Master''s (Sapiranga) e 180 Crew (São Leopoldo), ocorrendo ainda a Batalha Style Master''s x Múltiplo Estilo. Também haverá um show de Rap com Remanescentes do Culto Racional (Taquara) e Conspiração (Novo Hamburgo). Uma exposição de arte do grafite será apresentada por Argola Olhos (Sapiranga), Esmouqui Ufa (Porto Alegre), Nei FSC (Parobé) e Leo (Bento Gonçalves). </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A praça também sedia o Campeonato Skavator de Skate, com campeonato de amadores e apresentação de pilotos profissionais. A partir das 18 horas, a banda Código de Barras realiza a apresentação de encerramento da atividade. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
