 <div style="text-align: justify;"><font size="2"><font size="3"><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">       <font size="2"> A</font></span></font><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">s inscrições para o Exame Supletivo do Ensino Fundamental começam no dia 18 de outubro e estende-se até o dia 22. O local de inscrição será no Centro Municipal de Educação Dr. Décio Gomes Pereira - Unidade de Ensino Fundamental (Av. Presidente Kennedy, 2222, bairro São Luis) no horário das 17h30 às 20h30. <br />    As provas aplicadas no supletivo serão de Ensino Globalizado de 1</span><sup style="font-family: verdana,arial,helvetica,sans-serif;">o</sup><span style="font-family: verdana,arial,helvetica,sans-serif;"> a 4</span><sup style="font-family: verdana,arial,helvetica,sans-serif;">o</sup><span style="font-family: verdana,arial,helvetica,sans-serif;"> série e Língua Portuguesa (no dia 29 de novembro), Geografia (30/11), Matemática (01/12), História (02/12), Ciências (03/12) e Língua Estrangeira (04/12). Todas as provas até o dia 03 de dezembro acontecem das 19 às 22 horas. A prova de Língua Estrangeira, no sábado, dia 04 de dezembro, ocorre das 8 às 11 horas. </span></font></font><font size="1"><br style="font-family: verdana,arial,helvetica,sans-serif;" /></font><font size="1"><span style="font-family: verdana,arial,helvetica,sans-serif;">    Para prestar as provas, o candidato deve levar documento de identidade (original e xerox), duas fotos 3x4, iguais e sem uso, comprovante de residência em Sapiranga e Histórico Escolar ou atestado de escolaridade. A idade mínima para inscrição é 15 anos. Para o candidato que já prestou a prova anteriormente, será exigido apenas o documento de identidade e uma foto 3x4. Maiores informações na Secretaria Municipal de Educação e Desporto pelo telefone 599-1891.</span></font><br />         </div>     ', NULL, '2004-10-19', 11, '2004-09-23', '2004-10-23', NULL, N