<br />
A integração dos artistas, da comunidade e dos visitantes da 21ª Festa das Rosas começará com a apresentação de trabalhos em pintura, desenho, escultura e porcelana. Haverá uma pré-seleção dos trabalhos, que devem ser de artistas maiores de 18 anos de idade. O regulamento pode ser retirado no espaço cultural, que fica na rua Sete de Setembro, 766, das 8 às 11h30 e das 12h30 às 18h30. <br />
<br />
A premiação será de R$ 1 mil para o primeiro lugar, R$ 600 para o segundo colocado e R$ 400 para o terceiro lugar. A seleção dos trabalhos será feita por uma comissão formada por críticos de arte, artistas plásticos e professores. <br />
<br />
A exposição será de 3 a 15 de novembro, sendo o evento que irá abrir oficialmente a 21ª Festa das Rosas. Os trabalhos poderão ser conferidos de segunda a sextas-feiras, das 12h30 às 18h30, de terças a sextas-feiras das 8 às 11h30 e nos sábados e domingos, das 14 às 19 horas. <br />
