<font size="5" color="#000080">Festa das Rosas reúne bandas do rock gaúcho e <br />
bandinhas que garantem mais de 100 horas de baile </font></b><br /></span><span style="font-family: verdana,arial,helvetica,sans-serif;"><br /><br />A música estará presente em todos os momentos da Festa das Rosas, realizada em Sapiranga nos dias 6, 7, 13, 14 e 15 de novembro. Dez bandas foram contratadas para atender o palco de baile, incluindo Miramar Show, BrilhaSom e Terceira Dimensão. Segundo o coordenador geral da festa Flavio Konzen serão mais de 100 horas de show, começando às 15 horas e encerrando à 1 hora da manhã. Enquanto isso, no palco de shows, haverá doze bandas se apresentando no palco de show, dentre eles Papas da Língua, Da Guedes, TNT e Cidadão Quem. Os portões do Parque do Imigrante, que possui 8,4 hectares de área, estarão abertos a partir do meio-dia. Os ingressos custarão R$ 3,00 e crianças com até dez anos de idade estão isentas. Informações junto ao Departamento de Turismo, pelo telefone 599-1127. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
O Parque do Imigrante já estará aberto ao som das bandinhas. O primeiro dia começa com a Banda Típica Infanto-Juvenil, ao meio-dia, que se desloca pela festa. Depois, às 17 horas, é a vez da banda volante do Vovô. O baile começa com a Banda Star Som, às 16 horas e só sai quando a banda Montanara sobe no palco, às 21 horas. No palco de shows, o músico Délcio Tavares e grupo fazem um show especial às 20 horas. O rock começa a agitar o público com as bandas Kooks (21h30) e TNT, que faz sua performance a partir das 23 horas.</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">No segundo dia </span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><b>(domingo, 7)</b></font><span style="font-family: verdana,arial,helvetica,sans-serif;">, a missão de iniciar a animação da festa é da banda Canecão do Vale, que circula pelo parque do Imigrante até às 16 horas, quando é substituída pela Banda do Vovô. O palco de bailes vai ser tomado pela banda Miramar Show às 15 horas e depois de animar o público, a partir das 20 horas é a vez da banda Cia. Show 4 continuar com a diversão. No outro lado do parque, no palco de shows, se apresentam as bandas Vera Loca, às 20 horas, que abre para as bandas de renome nacional Cidadão Quem (21h30) e Rosa Tatooada (23 horas). </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
A Festa das Rosas continua no </span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><b>sábado (13)</b></font><span style="font-family: verdana,arial,helvetica,sans-serif;">, com shows volantes da banda Bandoneon, a partir das 12 horas e da Canecão do Vale, a partir das 17 horas. O baile começa às 16 horas com a banda Nova Fase e depois, às 21 horas, sobe ao palco a banda Brilha Som. Na terceira noite de shows de rock, o pavilhão de shows receberá as bandas Papas da Língua (21h) e Só Creedence (22h30). </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
No </span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><b>domingo (14)</b></font><span style="font-family: verdana,arial,helvetica,sans-serif;">, a banda Bandoneon circula pelo parque a partir das 12 horas e a banda Canecão do Vale toma o posto às 17 horas. O baile começa às 15 horas, com a Banda Barbarella e depois, a banda Inovação Arte &amp; Show se apresenta às 21 horas. No palco de shows, a banda Judit anima a galera às 21 horas e depois, a banda Da Guedes encerra a noite fazendo um show a partir das 22h30. 
</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><b>No feriado do dia 15</b></font><span style="font-family: verdana,arial,helvetica,sans-serif;">, a Banda Típica Infanto-Juvenil inicia a animação a partir das 12 horas e a Canecão do Vale prossegue a fazer a animação pelo parque a partir das 17 horas. O baile para a Terceira Idade inicia às 14 horas, com a banda Porto do Som. A partir das 20 horas, a banda Terceira Dimensão anima o baile. Os shows de rock começam a partir das 20 horas, de hora em hora, primeiro com a banda Hellfire, vice-campeão do Rotaract Rock Festival, depois com a Ecosofia, campeã do mesmo festival e encerrando às 22 horas, com a banda Os Formigos. 
</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-weight: bold; font-family: verdana,arial,helvetica,sans-serif;">Departamento de Comunicação</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Fone: 599-4499 / 240</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">imprensa@sapiranga.rs.gov.br</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
 ', NULL, '2004-10-22', 12, '2004-10-22', '2004-11-06', NULL, NULL, 0, NULL);
<font size="5" color="#000080">Prefeitura de Sapiranga estabelece parcerias para capacitar moradores interessados no setor agrícola</font></b><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Para fortalecer o setor agrícola e capacitar o morador para empreender na área, a prefeitura de Sapiranga está oferecendo cursos com instituições distintas. O Serviço Nacional de Aprendizagem Rural (Senar) estará realizando cursos gratuitos para a comunidade de Sapiranga a partir de janeiro, no município. Não é preciso ser agricultor para participar. Outra opção oferecida somente para quem for agricultor é na área da agroindústria. Neste caso, os interessados participam de aulas em escolas localizadas em Nova Petrópolis, Montenegro e Fazenda Souza (próximo a Caxias do Sul). A prefeitura oferece deslocamento e o pagamento dos cursos inscritos. Informações junto à Secretaria de Planejamento, pelo telefone 599-4499, ramal 206.<br /><br /></font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Os cursos do Senar precisar de grupos com no mínimo dez a doze pessoas de qualquer segmento da comunidade. Segundo a secretária de Planejamento Rosane Reichert, o objetivo é formar o maior número de turmas possíveis para aproveitar a oportunidade oferecida pelo Senar, que dispôs do mês de janeiro para realizar cursos no município. Entre as opções oferecidas são curso de produção de hortaliças, de construção e manejo de estufas, de manejo da cultura da batata, de implantação de pomar e de trator, de fruticultura e citros, de floricultura, de plantas medicinais, condimentares e aromáticas, de mel, de frango e ovos caipiras, de piscicultura, de melado e rapadura, embutidos, jardinagem, entre outros. As inscrições devem ser feitas o mais breve possível para definir data e local. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
<br style="font-family: verdana,arial,helvetica,sans-serif;" />
<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Voltado para a agroindústria, a prefeitura estará custeando o curso, alimentação, estadia e deslocamento para os agricultores interessados em participar de aulas oferecidas em escolas de agroindústrias nas cidades de Montenegro, Nova Petrópolis e Fazenda Souza (cidade emancipada de Caxias do Sul). A intenção é oferecer oportunidades de aprendizado e mais um incentivo para permanecer no campo, explica Rosane. Os participantes podem escolher dentre diversos cursos: confecção de doces, frutas desidratadas e produção e armazenagem de polpas de frutas, encurtidos em vinagre aromatizado, gado leiteiro, mecanização agrícola, manutenção e regulagem de pulverizadores, gerenciamento de propriedade agrícola, plantas medicinais, condimentares e aromáticas, fruticultura, entre outros.<br /><br /><span style="font-weight: bold;">Departamento de Comunicação</span><br />Fone: 599-4499 / 240<br />imprensa@sapiranga.rs.gov.br<br /></font>
