 <span style="font-family: verdana,arial,helvetica,sans-serif; color: rgb(204, 0, 0); font-weight: bold;">SAÚDE</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />


	
	
	
	





	
	
	
	

<p align="justify" style="margin-bottom: 0cm; font-family: verdana,arial,helvetica,sans-serif;">Neste
domingo (29), o projeto Domingo na Praça, realizado na Praça
da Bandeira de Sapiranga, sediará a 1ª Mateada de Combate
ao Fumo. A Equipe de Tabagismo da Secretaria de Saúde estará
promovendo uma ação de conscientização na
data em que é comemorado o Dia Nacional de Combate ao Fumo. Das
15 às 18 horas, o local sediará apresentações
de teatro e dança do Centro Municipal de Educação
Dr. Décio Gomes Pereira. Informações pelo
telefone 599-3932.<br /></p><p align="justify" style="margin-bottom: 0cm; font-family: verdana,arial,helvetica,sans-serif;">&nbsp;</p><p align="justify" style="margin-bottom: 0cm;">A
equipe de profissionais da secretaria estará distribuindo
material de conscientização e convida a comunidade a
trazer a cuia, a bomba e a térmica. A erva-mate e água
quente fica será oferecida pela Ervateira Schneider.
Informações pelo telefone 599-3932. 
</p>
<p align="justify" style="margin-bottom: 0cm;">&nbsp;</p><p align="justify" style="margin-bottom: 0cm; font-style: normal; text-decoration: none;">
<font color="#000000"><font size="2">Os
interessados em participar do grupo de apoio a fim de largar o vício
devem se inscrever na Unidade Sanitária Central, localizada na
rua Getúlio Vargas, 505 ou pelo telefone 599-3932. São
quatro encontros realizados nas terças-feiras, das 17h30 às
18h30. </font></font>


	
	
	
	<font color="#000000"><font size="2">Após,
são realizados encontros de manutenção,
quinzenalmente. O grupo deve ter no máximo 15 participantes, a
fim de possibilitar o atendimento mais individual. </font></font></p><p align="justify" style="margin-bottom: 0cm; font-style: normal; text-decoration: none;">&nbsp;</p>
