INSERT INTO noticias VALUES (24, 2, 'Borraxa expõe na Casa Tombada de Sapiranga', '<font size="1"><span style="font-weight: bold; color: rgb(255, 0, 0);">ARTE</span></font><font size="4" style="color: rgb(0, 0, 153);"><span style="font-weight: bold;"></span></font><h1 style="font-weight: normal;"><font size="2">Segue a exposição do artista plástico Borraxa na Casa Tombada, de Sapiranga. Telas e esculturas produzidas nos últimos 20 anos da carreira do artista plástico sapiranguense poderão ser conhecidas até a próxima sexta-feira (30). Após, a casa cultural recebe os trabalhos da artista plástico Rosângela Ratzlaff Carraro. A Casa Tombada fica na rua Duque de Caxias, 487, no bairro Centenário. Informações pelo telefone 529-1054. </font></h1><br /><br />
INSERT INTO noticias VALUES (25, 2, 'Gondoleiros é o campeão da Copa Xameguinha', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">ESPORTES<br /><br /></span><p><font size="2"><span style="font-family: verdana,arial,helvetica,sans-serif; color: rgb(0, 0, 0);">A preliminar do jogo de Associação Sapiranga e Brasil de Pelotas foi feita pelas equipes Gondoleiros e União Operária, disputando o troféu da Copa Xameguinha. Com uma vitória de 2 x 0, Gondoleiros recebeu o troféu por volta das 14h40 do diretor do Departamento de Desporto Guido Schuh e pelo jogador Xameguinha. O evento integrou a programação alusiva aos 180 Anos da Imigração Alemã no Rio Grande do Sul. </span></font></p><p><font size="2"><span style="font-family: verdana,arial,helvetica,sans-serif; color: rgb(0, 0, 0);"></span></font></p><p><font size="2"><span style="font-family: verdana,arial,helvetica,sans-serif; color: rgb(0, 0, 0);"></span><span style="font-family: verdana,arial,helvetica,sans-serif; color: rgb(0, 0, 0);">Nove equipes da categoria Juvenil participaram do campeonato, em dois meses de competição. A copa leva o nome do ex-jogador da equipe profissional de Novo Hamburgo, Xameguinha. </span></font></p><p><font size="2"><span style="font-family: verdana,arial,helvetica,sans-serif; color: rgb(0, 0, 0);"></span></font></p><span style="font-family: verdana,arial,helvetica,sans-serif; color: rgb(0, 0, 0);">
INSERT INTO noticias VALUES (27, 2, 'Pop rock e heavy metal no Domingo na Praça em Sapiranga', '<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><b><font size="1"><span style="color: rgb(204, 0, 0);">CULTURA</span></font><br /><br /></b></font><p><font size="2"><span style="font-family: verdana,arial,helvetica,sans-serif;">O projeto Domingo na Praça, realizado na Praça da Bandeira de Sapiranga, terá duas bandas de rock no próximo dia 1º de agosto. A partir das 16h30, a banda Majjors apresenta um show pop rock. A próxima banda a tocar é a Black Illusion, de Canoas, que apresenta, a partir das 18 horas, um show de heavy metal. A entrada é franca. Informações junto à Secretaria de Cultura e Turismo, pelo telefone 529-1054.</span></font></p><p><font size="2"><span style="font-family: verdana,arial,helvetica,sans-serif;">Os componentes da Majjors são de São Leopoldo e Novo Hamburgo. Guilheme é o guitarrista da banda, Heitor toca contrabaixo e Camilo toca bateria. Todos os três são vocalistas. A Black Illusion tem um ano e meio de formação, com Fábio (vocal), Edi (guitarra), Cavalo (guitarra), Anderson (bx) e Felipe (bateria).</span></font></p>
