INSERT INTO noticias VALUES (32, 2, 'Domingo na Praça de Sapiranga terá bandas da Região Metropolina ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">LAZER<br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">No próximo domingo (1º), o projeto Domingo na Praça terá como atração duas bandas de rock. A primeira a subir no palco da Praça da Bandeira, em Sapiranga, será a banda de pop-rock Majjors, de São Leopoldo. A partir das 18 horas, começa a apresentação da banda de heavy metal clássico Black Illusion, de Canoas. A entrada é franca. Informações junto à Secretaria de Cultura e Turismo, pelo telefone 529-1054.</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (34, 2, 'As Aventuras de Tibicuera no Centro de Cultura de Sapiranga', '<p style="font-weight: bold; color: rgb(204, 0, 0);"><span style="font-family: verdana,arial,helvetica,sans-serif;">CULTURA</span></p><p><span style="font-family: verdana,arial,helvetica,sans-serif;">A peça </span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><i>As Aventuras de Tibicuera</i></font><span style="font-family: verdana,arial,helvetica,sans-serif;">, será encenada pelo grupo D''Palco Teatro no dia 6 de agosto no Centro Municipal de Cultura Lúcio Fleck, em Sapiranga. Haverá quatro horários de apresentação: 8h30, 10 horas, 14 horas e 15h30min. O ingresso custa R$ 2,00. Informações pelo telefone 599-4058.
