INSERT INTO noticias VALUES (26, 2, 'Noite para rir com a comédia musical Rádio Esmeralda AM', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />#imagem#<br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Cartas de ouvintes, receitas de simpatias, comerciais ao vivo e muitas músicas. Hoje à noite(26), às 20 horas, a comédia musical </span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><i>Rádio Esmeralda </i></font><span style="font-family: verdana,arial,helvetica,sans-serif;">estará se apresentando no Centro Municipal de Cultura Lúcio Fleck. As artistas Adriana Marques e Simone Rassian encarnam as personagens </span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><i>Cat Milleidy </i></font><span style="font-family: verdana,arial,helvetica,sans-serif;">e </span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><i>Erothyides Malta</i></font><span style="font-family: verdana,arial,helvetica,sans-serif;">, duas apresentadoras de um programa radiofônico chamado </span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><i>Amor de Parceria</i></font><span style="font-family: verdana,arial,helvetica,sans-serif;">. Os ingressos, a R$ 15,00, estão à venda no Centro Municipal de Cultura Lúcio Fleck, Casa Tombada e na Escola São Mateus. Parte da renda do espetáculo será destinado para a construção da sede da Associação de Pais e Amigos dos Deficientes Auditivos (Apada). A promoção é do Sesc e apoio da Prefeitura de Sapiranga. Informações pelo telefone 599-4058.
