INSERT INTO noticias VALUES (31, 2, 'Cinema de Sapiranga exibirá Homem-Aranha 2 no fim-de-semana ', '<p><span style="font-weight: bold; color: rgb(204, 0, 0); font-family: verdana,arial,helvetica,sans-serif;">LAZER</span></p><p><span style="font-family: verdana,arial,helvetica,sans-serif;">Neste sábado e domingo (31/7 e 1/8), entra em cartaz o filme </span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><i>Homem-Aranha 2</i></font><span style="font-family: verdana,arial,helvetica,sans-serif;">, com Tobey Maguire. Haverá duas sessões por dia, às 16 horas e 20h30. Outras exibições estarão ocorrendo durante a semana e os próximos finais de semana no Centro Municipal de Cultura Lúcio Fleck (rua Sete de Setembro, 766). Ingressos a R$ 5 e R$ 3,00. Informações pelo telefone 599-4058.<br /></span></p><h3><font size="2"><u>Sessões:</u></font></h3>
INSERT INTO noticias VALUES (33, 2, 'Homem-Aranha 2 tem sessão de cinema durante a semana ', '<p style="font-weight: bold; color: rgb(204, 0, 0);"><span style="font-family: verdana,arial,helvetica,sans-serif;">LAZER</span></p><p><span style="font-family: verdana,arial,helvetica,sans-serif;">O Centro Municipal de Cultura Lúcio Fleck, em Sapiranga, estará exibindo o filme Homem-Aranha 2 durante a semana, além do sábado e domingo. As sessões estão marcadas de terça a quinta-feira (3, 4 e 5), terça e quinta-feira (10 e 12) e de terça a quinta-feira (17, 18 e 19), sempre às 20h30. O espaço cultural fica na rua Sete de Setembro, 766. Ingressos a R$ 5 e R$ 3,00. Informações pelo telefone 599-4058. </span></p>
INSERT INTO noticias VALUES (38, 2, 'Bandas, teatro e festival de vôo livre em Sapiranga', '
INSERT INTO noticias VALUES (39, 2, 'Bandas, teatro e festival de vôo livre em Sapiranga', '<p style="font-weight: bold; color: rgb(204, 0, 0);"><span style="font-family: verdana,arial,helvetica,sans-serif;">CULTURA</span></p><p><span style="font-family: verdana,arial,helvetica,sans-serif;">#imagem#</span></p><p><span style="font-family: verdana,arial,helvetica,sans-serif;">O 1º Face  Festival de Arte, Cultura e Esporte vai relembrar os 130 anos do Episódio Mucker em Sapiranga. Neste sábado e domingo (7 e 8), doze bandas subirão no palco do Parque Municipal do Imigrante. Haverá também a apresentação da peça teatral </span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><i>Rosas para Jacobina, </i></font><span style="font-family: verdana,arial,helvetica,sans-serif;">com dezenas de atores no elenco. A programação começa às 16 horas, com ingresso a R$ 5,00. Paralelo ao evento, ocorre o Festival Vôo Livre, no Morro Ferrabraz, das 13 às 17 horas. Informações junto à Secretaria de Cultura e Turismo, pelo telefone 529-1054, ou junto à Associação Gaúcha de Vôo Livre, no telefone 559-2552. </span></p>
