INSERT INTO noticias VALUES (104, 1, 'Semana do Trânsito segue com sua programação', 'Como parte da Semana Nacional de Trânsito, de 18 a 25 de setembro, as escolas da rede municipal  de Sapiranga realizam ao longo desta semana diversas atividades internas relacionadas ao tema. Com o slogan <span style="font-style: italic;">&quot;O Trânsito é feito de pessoas. Valorize a vida&quot;</span>, os alunos desenvolvem trabalhos cujo principal objetivo é a prevenção de acidentes. A Brigada Militar, Polícia Rodoviária Estadual e Guarda de Trânsito realizam palestras em escolas e empresas para falar sobre o trânsito. 
