INSERT INTO noticias VALUES (67, 2, 'Vasco e Atlético disputam troféu móvel da Copa Sapiranga', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">ESPORTE<br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">No último domingo (22), quatro equipes se enfrentaram em busca do troféu móvel da Copa Sapiranga Cláudio Adão Weiss. O resultado ficou em Vasco 2 x 0 Barcelona e Atlético 2 x 1 Estrela. A data e o local para a final entre Vasco e Atlético está sendo definida pelo Departamento de Desporto de Sapiranga. Informações pelo telefone 599-3673. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
