INSERT INTO noticias VALUES (70, 2, 'Sessão para as crianças no Centro de Cultura de Sapiranga', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">LAZER</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><b><i>Didi quer ser criança será exibido neste fim-de-semana<br /></i></b></font><span style="font-family: verdana,arial,helvetica,sans-serif;">O Centro Municipal de Cultura Lúcio Fleck, de Sapiranga, está com novo filme em cartaz. É o brasileiro </span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><i>Didi quer ser criança. Neste</i></font><span style="font-family: verdana,arial,helvetica,sans-serif;"> sábado (28) a sessão será realizada às 20h30 e no domingo (29), haverá duas sessões, às 16 horas e às 20h30. Ingressos a R$ 5,00 e R$ 3,00. Informações pelo telefone 599-4058.</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (71, 2, 'Final da Quadrangular da Copa Sapiranga será no sábado', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">ESPORTES</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">No próximo sábado (28), está marcada a final da Quadrangular da Copa Sapiranga Cláudio Adão Weiss. O Departamento Municipal de Desporto informa que a final entre Vasco (vencedor da copa em 2004) e Atlético (vencedor em 2003) está marcada para às 15 horas no Estádio das Rosas (campo da Associação). Informações pelo telefone 599-3673. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><b>Resultado da quadrangular, em 22 de agosto:</b></font><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
INSERT INTO noticias VALUES (80, 2, 'Atletas de Sapiranga são convidados para participar de rústica neste sábado', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 51);">ESPORTE</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">O 8º Circuito de Rústica nos Bairros estará sendo realizado neste sábado (4), no Parque Municipal do Imigrante. Podem participar atletas de Sapiranga, a partir dos 12 anos de idade. A inscrição é gratuita e deve ser feita no local, a partir das 13h30. A largada será às 15 horas. Haverá troféu e medalhas para os primeiros colocados.  Informações pelo telefone 9226-5457. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (72, 2, 'Torneio de Xadrez em Sapiranga no sábado', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">EDUCAÇÃO</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Neste sábado (4), o Centro Municipal de Educação Dr. Décio Gomes Pereira sedia o I Torneio Aberto de Xadrez e a 4ª Etapa do Circuito Escolar Gaúcho. A programação ocorre das 8h30 às 17h30. Troféus e medalhas serão oferecidos aos vencedores das sete categorias criadas para enxadristas com mais de oito anos de idade. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">As inscrições custam R$ 2,00 (antecipados na secretaria das escolas ou por meio de depósito bancário) ou R$ 5,00 na hora. O telefone para informações é o 529-2198. O estabelecimento de ensino fica na avenida Presidente Kennedy, 2222, no bairro São Luiz. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">A inscrição por meio de depósito bancário pode ser feito na Caixa Econômica Federal Agência 0514, conta da Associação de Pais e Mestres número 03000788-8, mediante comprovação via fax pelo telefone 529-2198 com Silas. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (73, 2, 'Sapiranga se classifica no JIRGS com bolão e handebol', '<span style="font-family: verdana,arial,helvetica,sans-serif;"><span style="font-weight: bold; color: rgb(204, 0, 0);">COMUNIDADE</span><br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">Depois de vencer as equipes de Pareci Novo, Barão e Portão, a equipe de Bocha Masculina representando Sapiranga se classificou para os Jogos Intermunicipais do Rio Grande do Sul (JIRGS). O jogo ocorreu no sábado (28), na Sociedade Ginástica de Novo Hamburgo (SGNH). Os atletas participantes foram Edson Lopes Corrêa, Sandro da Silva Bittencourt, Everton Freitag Terres, José João Pillan Bolzan e João Carlos Sperb. A competição está marcada para o dia 25 de setembro, em Passo Fundo. A equipe treina na Sede Campestre do Clube 19 de Julho.</span>
INSERT INTO noticias VALUES (74, 2, 'Débora Gerhard é destaque nacional ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">ESPORTE</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A ciclista sapiranguense Débora Gerhard tem nome e atuação citada em reportagem da edição dois da Revista Cycle Sport Magazine, de São Paulo. Em outra revista paulista, a Byke Action número 48, uma imagem da atleta aparece em anúncio da Vzan, empresa que vem patrocinando e incentivando o esporte. <br /><br /></font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A gaúcha, de 18 anos, está participando de inúmeras competições nacionais e atualmente é patrocinada pelas empresas Scott, Fadenp e o município de São José dos Campos. Mesmo assim, a cidade de Sapiranga é sempre mencionada pela atleta, que é uma das destaques na prova de ciclismo feminino.</font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (75, 2, 'Cristina Marcquart e amigos em exposição no Centro de Cultura de Sapiranga', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Os trabalhos de artistas plásticos de Novo Hamburgo, São Leopoldo, Sapiranga e Campo Bom estão reunidos no Centro Municipal de Cultura Lúcio Fleck, em Sapiranga. Até o dia 13 de setembro, é possível conferir a exposição Gostamos de Pintar, da artista Cristina Marcquart e outros 25 artistas, que reúnem telas no estilo figurativo, figura humana, abstrato e rostos em óleo sobre tela e acrílico. </font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Nosso grupo se reúne porque gosta de pintar, de trocar conhecimentos. Pode se experimentar de tudo, nada é proibido, explica Cristina. Informações pelo telefone 527-2743.</font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
