INSERT INTO noticias VALUES (81, 2, 'Didi quer ser criança no Centro de Cultura', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">LAZER</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Segue em cartaz no Centro Municipal de Cultura Lúcio Fleck a comédia <i>Didi quer ser Criança, </i></font><span style="font-family: verdana,arial,helvetica,sans-serif;">As sessões estão marcadas para sábado (4), às 20h30 e domingo (5), às 16h e 20h30. Ingressosa R$5,00 e R$3,00 (com carteirinha de estudante).
INSERT INTO noticias VALUES (82, 2, 'Domingo com música alemã e rock cover na Praça da Bandeira', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Neste domingo (5), a partir das 16 horas, a banda típica de sopro Só Se For Agora, de Sapiranga, estará tocando em volta da Praça da Bandeira, tendo um repertório que inclui a música alemã. A partir das 17 horas, a acústica da praça central irá difundir o rock cover da banda Nostalgia, de Sapiranga. A Praça da Bandeira fica na avenida João Corrêa, s/n, em Sapiranga. Informações pelo telefone 529-1054. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (83, 2, '3,5 quilômetros da Rústica de Sapiranga reúne 57 atletas', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">ESPORTE</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Os 57 participantes do 8º Circuito de Rústica nos Bairros percorreram os 3,5 quilômetros de prova num sábado (4) ensolarado. Os atletas saíram do Parque Municipal do Imigrante e percorreram a avenida Mauá, a rua da Ladeira, a rua Alberto Schmitt, retornando para o parque. O mais veloz foi o atleta Tiago Minho, que também disputa provas no ciclismo e venceu a rústica do ano passado. <br /><br /></font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Na categoria Geral, o primeiro lugar foi Tiago Minho, seguido por Claudiomiro Skoreck (2º lugar) e Jonas Araújo. Segundo o coordenador da prova, Marcos Lorenz, da Prefeitura Municipal, a prova ocorreu de forma tranqüila e já vem se tornando uma tradição dos atletas que gostam de correr. O atleta mais novo foi Alexandre Quarema (13 anos, 2º lugar na categoria) e o mais velho foi o Tio Zé, de Campo Bom, com 67 anos (1º lugar na categoria). <br /><br /></font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Troféus e medalhas foram oferecidos para os primeiros colocados. A próxima prova ocorrerá no dia 25 de setembro, no Centro Municipal de Educação Dr. Décio Gomes Pereira, no bairro São Luiz. Informações pelo telefone 9226-3376.<br /><br /></font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><b>Demais categorias: </b></font><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">
INSERT INTO noticias VALUES (84, 2, 'Sapiranga sedia a 5ª Corrida pela Vida será no sábado ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">COMUNIDADE</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">No próximo sábado (11), ocorrerá a 5ª Corrida pela Vida. A saída será às 9h30, na Praça da Bandeira. Haverá shows e sorteio de bicicletas. A promoção é do Instituto do Câncer Infantil e apoio da Liga Feminina de Combate ao Câncer. As camisetas que garantem recursos para o Instituto do Câncer Infantil podem ser adquiridas nas lojas Dó Ré Mi, Di Zuppo, Dispairada ou Tintas Royal, a R$ 7,00. Informações pelo telefone 599-2966. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
