INSERT INTO noticias VALUES (86, 2, 'Cazuza entra em cartaz no sábado ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">LAZER</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">O Centro Municipal de Cultura Lúcio Fleck, em Sapiranga, está com novo filme em cartaz. A partir do sábado (11), entra em cartaz Cazuza  O tempo não pára, com </font><span style="font-family: verdana,arial,helvetica,sans-serif;">Daniel de Oliveira, Marieta Severo e grande elenco. Os dias de exibição são 11, 12, 15, 18, 19, 25 e 2</span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">6 de setembro, sempre às 20h30. Ingressos a R$ 5,00 e R$ 3,00. Informações pelo telefone 599-4058.<br /><br /></font><span style="font-family: verdana,arial,helvetica,sans-serif;">SINOPSE: A vida louca que marcou o percurso profissional e pessoal de Cazuza (Daniel de Oliveira), do início da carreira, em 1981, até a morte em 1990, aos 32 anos: o sucesso com o Barão Vermelho, a carreira solo, as músicas que falavam dos anseios de uma geração, o comportamento transgressor e a coragem de continuar a carreira, criando e se apresentando, mesmo debilitado pela Aids. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
