INSERT INTO noticias VALUES (89, 2, 'projeto Jornal NH na sua cidade ', '<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><span style="color: rgb(204, 0, 0); font-weight: bold;">GERAL<br /><br /></span>Neste sábado (11), a Praça da Bandeira sedia a realização do projeto Jornal NH na sua Cidade. Das 9 às 12 horas, haverá a promoção de serviços gratuitos e orientações sobre direitos na área da saúde, meio ambiente, educação e turismo, além de apresentações culturais e sorteio de brindes. Em caso de chuva o projeto ocorrerá no mesmo local. O projeto tem o patrocínio da Brasil Telecom. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (90, 2, 'Baile da terceira idade', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">GERAL<br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">O Grupo Municipal de Terceira Idade Primavera, de Sapiranga, está completando sete anos de atividades. No dia 22 de setembro, o grupo de convivência promove um baile comemorativo, no Star Club, a partir das 13h30, com a banda Bons Tempos. Ingressos a R$ 3,00. A atividade também marca o Dia Nacional do Idoso, em 27 de setembro. Informações pelo telefone 599-3996.</span>
INSERT INTO noticias VALUES (91, 2, 'Salão do Artista Gaúcho ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">A exemplo dos anos anteriores, o Salão do Artista Gaúcho, realizado pelo Centro Municipal de Cultura Lúcio Fleck, de Sapiranga, estará sediando a exposição de trabalhos de mais de 90 artistas. A abertura da quarta edição será nesta terça-feira (14), às 20 horas, no espaço cultural, localizado na rua Sete de Setembro, 766. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Os artistas são oriundos de Porto Alegre, São Leopoldo, Novo Hamburgo, Campo Bom, Parobé, Sapiranga, entre outros e apresentam trabalhos em pintura, escultura e desenho, com tema livre. A exposição segue até dia 4 de outubro. </span><font size="2" style="font-family: verdana,arial,helvetica,sans-serif;">O espaço cultural fica aberto de segunda a sexta-feira, das 8 às 11h e das 13 às 17h e em dias e noites de eventos. </font><span style="font-family: verdana,arial,helvetica,sans-serif;">Informações pelo telefone 599-4058. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (92, 2, 'Sessão especial de Cazuza ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">LAZER</span><br style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold;" /><br style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold;" /><meta content="text/html; charset=utf-8" http-equiv="CONTENT-TYPE" /><title></title><meta content="OpenOffice.org 1.0.2  (Linux)" name="GENERATOR" />
INSERT INTO noticias VALUES (93, 2, 'Rústica nos bairros de Sapiranga', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">ESPORTE<br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A Prefeitura de Sapiranga realiza a segunda etapa do 8º Circuito de Rústica nos bairros no dia 25. A largada será às 15 horas, do Centro Municipal de Educação Dr. Décio Gomes Pereira, localizado na avenida Presidente Kennedy, 2222, no bairro São Luiz. Podem participar atletas a partir dos 12 anos de idade. Os atletas terão que percorrer 4,5 quilômetros de prova. Haverá troféu e medalhas para os primeiros colocados. A inscrição é gratuita e deve ser feita no local, a partir das 13h30. Informações pelo telefone 9226-5457. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (94, 2, 'Exposição de 91 artistas', '<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><span style="font-weight: bold; color: rgb(204, 0, 51);">CULTURA</span><br />Diferentes estilos, temas e técnicas da arte poderão ser conhecidos no Centro Municipal de Cultura Lúcio Fleck, em Sapiranga, onde ocorre o 4 º Salão do Artista Gaúcho. Até o dia 4 de outubro, 91 artistas apresentarão pinturas, desenhos e esculturas distribuídos desde o saguão até o auditório do espaço cultural. A abertura ocorrerá às 20 horas, quando será oferecido um coquetel para os artistas e convidados. O espaço cultural fica aberto de segunda a sexta-feira, das 8 às 11h e das 13 às 17h e em dias e noites de eventos. O centro de cultura fica na rua Sete de Setembro, 766. Informações pelo telefone 599-4058. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (95, 2, 'Domingo na Praça com tradicionalismo', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">GERAL</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">No próximo domingo (19), a programação do projeto Domingo na Praça, em Sapiranga, contará com apresentações alusivas à Semana Farroupilha. A partir das 14 horas, a Praça da Bandeira receberá os CTGs Galpão Sentinela do Pago, Pedro Serrano e Desgarrados da Querência. Além disso, o trio Fórmula 3 apresentará música gaúcha e sertaneja a partir das 17 horas. A praça fica na avenida João Corrêa, área central de Sapiranga. Informações pelo telefone 529-1054.<br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Das 14 às 17 horas, o público será convidado a acompanhar apresentações de dança e música dos CTGs Galpão Sentinela do Pago, Pedro Serrano e Desgarrados da Querência. A partir das 17 horas, o trio Fórmula 3, composto por José Paulo Gomes (teclado, gaita e vocal), Sidnei Luiz Martins (guitarra), Silvério (contrabaixo), apresenta a música gaúcha e sertaneja. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (96, 2, 'Espetáculo Negrinho do Pastoreio ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA<br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">Cavaquinho, acordeom, flauta doce e o bombo legüero, junto com pernas-de-pau e acrobacias vão compor o próximo espetáculo do Projeto Lâmpada Mágica. Na próxima segunda-feira (20), às 20 horas, o Centro Municipal de Cultura Lúcio Fleck, de Sapiranga, estará sediando a apresentação da peça O Negrinho do Pastoreio, do grupo Oigalê Cooperativa de Artistas Teatrais. O ingresso custa R$ 6 e R$ 3 (com a apresentação da carteira do estudante). Parte da renda do evento será destinada para a Biblioteca Dr. Armindo Setembrino Farina, do Instituto Estadual Genuíno Sampaio. Informações pelo telefone 599-4058. <br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Apesar de ser uma tragédia, o &quot;Negrinho&quot; é encenado como uma grande brincadeira, contada por cinco atores que se revezam na execução dos personagens. Tem músicas compostas exclusivamente e executadas ao vivo pelos atores. O espetáculo faz parte do projeto de pesquisa intitulado Trilogia Pampiana, que trabalha exclusivamente dentro do universo gaúcho para buscar uma aproximação com as origens. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (97, 2, 'Show com Dante Ramon Ledesma', '<span style="font-family: verdana,arial,helvetica,sans-serif;"><span style="font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">Nesta sexta-feira (17), às 20h30, o cantor e compositor argentino Dante Ramon Ledesma estará em Sapiranga, realizando a apresentação Voz e Folclore dos Povos Latinos. A apresentação ocorrerá no Centro Municipal de Cultura Lúcio Fleck, localizado na rua Sete de Setembro, 766. Os ingressos custam R$ 12 e R$ 8 (Cartão do Assinante Jornal NH). Informações pelo telefone 599-4058. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Ledesma está radicado em Porto Alegre e defende em suas canções a identidade da cultura latino-americana. Ele apresenta ritmos latinos, gauchescos e populares brasileiros.</font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
