INSERT INTO noticias VALUES (101, 2, 'Rústica em Sapiranga ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">ESPORTE<br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Neste sábado (25), ocorre a segunda etapa do 8º Circuito de Rústica nos Bairros, em Sapiranga. A largada será às 15 horas, do Centro Municipal de Educação Dr. Décio Gomes Pereira, localizado na avenida Presidente Kennedy, 2222, no bairro São Luiz. Podem participar atletas a partir dos 12 anos de idade. <br /><br /></font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Os participantes terão que percorrer 4,5 quilômetros de prova. Haverá troféu e medalhas para os primeiros colocados. A inscrição é gratuita e deve ser feita no local, a partir das 13h30. Na primeira etapa, Tiago Minho garantiu a primeira colocação, dentre os 57 participantes. Informações pelo telefone 9226-5457. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (105, 2, 'Acústico Blue vence Festival de Rock ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">GERAL</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="2" style="font-family: verdana,arial,helvetica,sans-serif;">A música Paz no trânsito, ainda há muito a se viver, da banda Acústico Blue conquistou o corpo de jurados do Festival de Rock pela Paz no Trânsito II, realizado no último sábado (25), em frente ao Chaps Billiard. Com o refrão É hora de acordar e mudar, Há coisas que é preciso acreditar, É hora de aprender, E ver que ainda há muito a se viver, a banda conquistou o prêmio de R$ 300,00 e o direito à apresentação no projeto Domingo na Praça. Oito bandas se apresentaram no local, marcando o encerramento da Semana Nacional do Trânsito, que contou com caminhada, atividades recreativas e orientação às crianças, ciclistas e motoristas. <br /><br /></font><font size="2" style="font-family: verdana,arial,helvetica,sans-serif;">As bandas Quarto Studio, RockStone, Etna, Ecosofia, Ferro Velho, Gertrudes, Exclusoz e Acústico Blue participaram da atividade. As bandas apresentaram músicas cover e compuseram uma música com o tema Paz no Trânsito, avaliadas por um corpo de jurados. <br /><br /></font><font size="2" style="font-family: verdana,arial,helvetica,sans-serif;">A Acústico Blue tem na formação Rafael Breyer (vocal e violão), Saul Wallauer (baixo), André Arnecke (bateria) e Tiago Fernandes (guitarra). O prêmio oferecido foi o valor de R$ 300,00 e a participação no projeto Domingo na Praça, em data a ser definida. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
