INSERT INTO noticias VALUES (107, 2, 'Salão do Artista Plástico Gaúcho', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="2" style="font-family: verdana,arial,helvetica,sans-serif;">Os trabalhos de 91 artistas plásticos permanecem em exposição no Centro Municipal de Cultura Lúcio Fleck, em Sapiranga. O 4º Salão do Artista Plástico Gaúcho segue até o dia 3 de outubro. O visitante poderá conferir as pinturas em tela, desenhos e esculturas e eleger a melhor obra. O resultado do júri popular será divulgado a partir do dia 4. Os três trabalhos mais votados pelo público receberão troféus. O espaço cultural fica aberto de segunda a sexta-feira, das 8 às 11h e das 13 às 17h e em dias e noites de eventos. O centro de cultura fica na rua Sete de Setembro, 766. Informações pelo telefone 599-4058. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
