INSERT INTO noticias VALUES (122, 2, 'Júri popular elege O Sonho de Valentina', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA<br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">Terminou ontem (04) o 4º Salão do Artista Plástico Gaúcho, que teve a participação de 91 artistas. A apuração dos votos depositados na urna localizada no Centro Municipal de Cultura Lúcio Fleck, em Sapiranga, resultou na preferência da tela </span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><i>O Sonho de Valentina</i></font><span style="font-family: verdana,arial,helvetica,sans-serif;">, da artista plástica Natália Becker Hübner, de Sapiranga. Na quarta-feira (6), às 17 horas, será feita a entrega dos troféus aos primeiros colocados. O júri popular contou com 304 votos dos visitantes. Informações pelo telefone 599-4058. 
