INSERT INTO noticias VALUES (114, 2, 'Reunião sobre medicamentos especiais', '<font size="3" style="font-family: verdana,arial,helvetica,sans-serif;"><span style="font-weight: bold; color: rgb(204, 0, 0);">SAÚDE</span><br /><br />Um Banco de Medicamentos e a criação de uma associação são os temas da reunião que a Farmácia Municipal de Sapiranga promove nesta terça-feira (5), às 9 horas, na sala de reunião da Secretaria da Saúde. De acordo com o farmacêutico Émerson Leite, a possível falta de remédios podem ser solucionadas com as alternativas a serem propostas aos participantes. A secretaria fica na rua Getúlio Vargas, 505. Informações pelo telefone 599-3932. </font>
