INSERT INTO noticias VALUES (121, 2, 'Feriado do Dia do Funcionário Público e do Professor ', '<span style="font-family: verdana,arial,helvetica,sans-serif;"><span style="font-weight: bold; color: rgb(204, 0, 0);">GERAL</span><br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">O feriado em comemoração ao Dia do Funcionário Público e do Dia do Professor foi transferido para o dia 11 de outubro no município de Sapiranga. Ao invés do dia 28 e do dia 15, respectivamente, a data será comemorada na segunda-feira. A prefeitura decidiu pela antecipação a fim de coincidir com o feriado de Nossa Senhora Aparecida, no dia 12. <br /><br />O expediente da prefeitura voltará à normalidade no dia 13, com atendimento das 12h30 às 18h30. As consultas e pequenos procedimentos médicos podem ser feitas no Posto de Atendimento Médico 24 Horas. As emergências e urgências de saúde são realizadas no Hospital de Sapiranga. Informações pelo telefone 599-4499. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (123, 2, 'Cinco dias de exposição de orquídeas', '<span style="font-family: verdana,arial,helvetica,sans-serif;"><span style="font-weight: bold; color: rgb(204, 0, 0);">COMUNIDADE</span><br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">No período favorável para o florescer das orquídeas, seis orquidófilos da região estarão realizando uma mostra da flor no Centro Municipal de Cultura Lúcio Fleck, em Sapiranga. De 6 a 10 de outubro, Rudi Dietrich (Campo Bom), Arnaldo Siebel (Taquara) e os sapiranguenses Remi Dresch, Agostinho Nunes, Selvino Lutz e João Livi apresentam cerca de 50 plantas cultivadas. O objetivo é despertar o interesse das demais pessoas pelo cultivo da orquídea, explica Dresch. O curto período de exposição é em função dos cuidados necessários com as plantas. Informações pelo telefone 599-4058. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">A visitação pode ser feita de segunda a sexta-feira, das 8 às 11h30 e das 12h30 até 22h e nos sábado e domingos, quando há atividades na casa, que fica localizada na rua Sete de Setembro, 766.</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
