INSERT INTO noticias VALUES (128, 2, 'Rock no Domingo na Praça', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Neste domingo (6), a Praça da Bandeira volta a receber artistas dentro do projeto Domingo na Praça. A Secretaria de Cultura e Turismo traz a banda Aperte o Play, de Novo Hamburgo, que se apresenta a partir das 17 horas, e após, a banda Via Brazil, de Sapiranga. Ambas apresentam músicas cover no estilo pop/rock. Informações pelo telefone 529-1054. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A primeira banda a subir no palco da praça sapiranguense é a Aperte o Play, formada no início deste ano. Formada por Cleber (vocal), Beto (bateria), Eduardo Winck (baixo), Rafinha (teclado), Maicon (guitarra) e Gabriel Fernandes (guitarra-solo), todos têm experiências em outras bandas. Aperte o Play, iniciou interpretando autorias de grandes bandas e cantores, assim como suas composições próprias.<br /><br /></font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A Via Brazil se apresenta a partir das 18 horas na Praça da Bandeira. Tendo o André na voz e violão, Levi na guitarra, Douglas no contrabaixo, Lucas na guitarra e Mateus na bateria, a banda apresenta músicas cover do pop/rock nacional, como Jota Quest, Skank, Paralalas do Sucesso, Catuípe, Natirruts, CPM 22 e Charlie Brown Jr. </font>
INSERT INTO noticias VALUES (129, 2, 'Sarau Literário de Sapiranga ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Na sexta-feira (15), música, dança gauchesca e sessão de autógrafos do livro A Memória de </font><span style="font-family: verdana,arial,helvetica,sans-serif;">Deus, do sapiranguense Paulo Fleck, vão estar inseridos na programação do Sarau Literário,</span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">&nbsp;</font><span style="font-family: verdana,arial,helvetica,sans-serif;">que é</span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">&nbsp;</font><span style="font-family: verdana,arial,helvetica,sans-serif;">retomado pela Sociedade Literária de Sapiranga. O CTG Sentinela do Pago sedia o evento e</span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">&nbsp;</font><span style="font-family: verdana,arial,helvetica,sans-serif;">vaioferecer</span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">&nbsp;</font><span style="font-family: verdana,arial,helvetica,sans-serif;">um carreteiro,</span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">&nbsp;</font><span style="font-family: verdana,arial,helvetica,sans-serif;">a R$ 5,00. O</span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">&nbsp;</font><span style="font-family: verdana,arial,helvetica,sans-serif;">evento inicia às 19 horas. O CTG</span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">&nbsp;</font><span style="font-family: verdana,arial,helvetica,sans-serif;">f</span><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">icana avenida 20 de Setembro, 7980, no bairro Amaral Ribeiro). Informações pelo telefone 529-1054. <br /><br /></font><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Unindo o gosto pela literatura com a tradição gaúcha, a Sociedade Literária reunirá as pessoas no CTG Sentinela do Pago. A comunidade é convidada para ouvir histórias, poesias e assistir às apresentações artísticas de música e dança gauchesca. O escritor Paulo Fleck estará autografando o livro A Memória de Deus, recentemente lançado no Centro de Cultura de Sapiranga. A promoção conta com o apoio da Secretaria de Cultura e Turismo. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (130, 2, 'Guarda de Sapiranga realiza fiscalização e orientação', '<span style="font-family: verdana,arial,helvetica,sans-serif;"><span style="font-weight: bold; color: rgb(204, 0, 0);">GERAL</span><br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">Com o intuito de reduzir o número de acidentes de trânsito, na véspera do feriado de Nossa Senhora Aparecida, a Guarda de Trânsito de Sapiranga estará realizando a fiscalização e orientação aos motoristas nesta sexta-feira (8). </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
