INSERT INTO noticias VALUES (133, 2, 'Irmãos de Fé entra em cartaz ', '<span style="font-family: verdana,arial,helvetica,sans-serif;"><span style="font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">A partir deste sábado (16), o Centro Municipal de Cultura Lúcio Fleck exibe o filme Irmãos de Fé, tendo no elenco o padre Marcelo Rossi, Thiago Lacerda e Othon Bastos. As sessões estão marcadas para sábado (16) e domingo (17), às 20h30 e também no sábado da próxima semana, dia 23, às 20h30. Ingressos a R$ 5,00 e R$ 3,00 para estudantes. Informações pelo telefone 599-4058.</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (134, 2, 'Teatro na quinta-feira ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">O Centro Municipal de Cultura Lúcio Fleck estará recebendo o Grupo Farsa na próxima quinta-feira (14). Quatro apresentações estarão sendo realizadas para as crianças assistirem à peça A </span><span style="font-family: verdana,arial,helvetica,sans-serif;">Princesa Engasgada, às 8h, 9h30, 14h e 15h30. À noite, é vez dos adultos se distraírem com a peça Os Farsantes, às 20 horas. Em ambas atrações, o ingresso custa R$ 2,00. Informações pelo telefone 599-4058. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (135, 2, 'Escola de Educação Infantil São Luiz ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">EDUCAÇÃO</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">A partir desta quarta-feira (13), gincana, brincadeiras e shows marcam a Semana da Criança na Escola Municipal de Educação Infantil São Luiz. As comemorações culminam no sábado (16), com apresentação das horas do conto de todas as turmas. A atividade inicia às 9 horas e deve prosseguir até por volta das 11 horas. <br /><br />Pretendemos mostrar aos pais o que as crianças estão realizando na escola e integrar as famílias, explica a diretora Jaqueline Fabiane de Vargas. A escola fica na rua Visconde de São Leopoldo, 455, no bairro São Luiz. Informações pelo telefone 599-3603.</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (136, 2, 'Campeonato Municipal de Futebol', '<span style="font-family: verdana,arial,helvetica,sans-serif;"><span style="font-weight: bold; color: rgb(204, 0, 0);">ESPORTE</span><br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">No domingo (10), o Campeonato Municipal de Futebol de Sapiranga teve a segunda rodada para a Chave A e a terceira para a Chave B. Foram 56 gols marcados nos jogos de Veteranos (9h30), 2º Quadro (13h30) e 1º Quadro (15h30) nas duas chaves, sendo 33 da Chave A. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (137, 2, 'Teatro de fantoches incentiva alimentação', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">SAÚDE<br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">A partir da próxima segunda-feira (18), postos de saúde de Sapiranga estarão sediando a apresentação de Teatro de Fantoches com o tema Coma mais frutas e verduras. A Secretaria da Saúde pede que as mães levem os filhos a fim de se divertir e de se informar sobre alimentação saudável. A atividade marca a comemoração do Dia Mundial da Alimentação, em 16 de outubro. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
