INSERT INTO noticias VALUES (139, 2, 'Domingo na Praça ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">No próximo domingo (17), o Projeto Domingo na Praça contará com o show de duas bandas sapiranguenses premiadas em festivais de rock. A Secretaria de Cultura e Turismo convidou a banda Ecosofia, vencedora do Rotaract Rock Festival, e a Acústico Blue, que conquistou o 1º lugar no Festival de Rock Paz no Trânsito II. Aproveitando o tema, o Corpo de Bombeiros realiza simulação de acidente de trânsito a fim de promover a conscientização do público. A Ecosofia faz show na Praça da Bandeira, às 17 horas e a Acústico Blue sobe no palco às 18h30. Informações pelo telefone 529-1054.</font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (140, 2, 'Domingo tem Varzeano ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">ESPORTE</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">No próximo domingo (17), o Campeonato Municipal de Futebol de Sapiranga continua a levar atletas e público para os campos da cidade. Os jogos do Veterano ocorrem às 9h30, do 2º Quadro às 13h30 e do 1º Quadro às 15h30. Informações junto ao Departamento de Desporto, pelo telefone 599-3673. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
