INSERT INTO noticias VALUES (146, 2, 'Financiamento para agricultores', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">AGRICULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">O Comitê Gestor Municipal de Sapiranga estará realizando uma reunião de apresentação das regras do Programa Nacional de Crédito Fundiário. Será na próxima quarta-feira (20), às 14 horas, no Plenário da Câmara de Vereadores (avenida João Corrêa, 808). <br /><br />O programa substituiu o Banco da Terra. O comitê é composto pela Secretaria Municipal de Agricultura, Sindicato dos Trabalhadores Rurais e Emater. Este comitê orientará e receberá as propostas dos interessados em adquirir terras pelo programa de financiamento. Informações pelo telefone 599-4499. </font><br style="font-family: verdana,arial,helvetica,sans-serif;" />
