INSERT INTO noticias VALUES (150, 2, 'Parque do Imigrante preparado para festa', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">EVENTOS</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Pavilhões piramidais e túneis vão ser erguidos no Parque Municipal do Imigrante, local onde ocorrerá a 21ª Festa das Rosas, em Sapiranga. Segundo a Comissão Organizadora, existe uma preocupação em proteger os visitantes, a previsão é de 90 mil pessoas, do intenso sol ou de chuva. A estrutura será baseada em quatro pavilhões piramidais, interligados por túneis. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (151, 2, 'Festival reúne talentos estudantis', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">GERAL<br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">De 25 a 28 de outubro, a Secretaria de Educação e Desporto estará reunindo os estudantes das três redes de ensino para o Festival Municipal Artístico Escolar (Femae). O Centro Municipal de Cultura Lúcio Fleck estará sediando apresentações de esquetes, dança criativa, dança folclórica, música, poesia e leitura nos três turnos: das 8 às 11h45, das 13h30 às 17h30 e das 19 às 22h30. A entrada é franca e aberto à comunidade. Informações pelo telefone 599-1891.</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (162, 2, 'Futsal joga em Três Coroas', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">ESPORTE</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A equipe Sapiranga/Futsal jogará um amistoso quinta-feira, 21/10, às 20 horas frente a equipe AABC, no Ginásio Municipal de Três Coroas. A equipe sapiranguense conta com os atletas Israel da Silva, Cleber Machado, Rudinei dos Santos, Licênio de Castros, Osnei Guimarães, Leonardo Steigleder, Douglas Coronetti, João de Castros, Samuel da Silva, Edejalmo Brizolla, Eduardo Prado e Márcio Backes. <br /><br /></font><span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold;">Departamento de Comunicação</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">Fone: 599-4499 / 240</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">imprensa@sapiranga.rs.gov.br</span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
