INSERT INTO noticias VALUES (153, 2, 'Centro de Cultura e a Estupidez Humana', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Começou hoje (19) a exposição do artista plástico Fabiano Silveira, que apresenta <i>Estupidez Humana I/VII</i></font><span style="font-family: verdana,arial,helvetica,sans-serif;">no Centro Municipal de Cultura Lúcio Fleck, em Sapiranga, até o dia 29. Trata-se de uma série de sete trabalhos, em painéis e instalações, mostrando a violência. Por isso, o preto e o vermelho estão presentes na maioria dos trabalhos. A intenção é promover uma conscientização individual de quem vê o trabalho assim como uma reflexão do quanto cada um contribui para a violência, explica. 
INSERT INTO noticias VALUES (154, 2, 'Provas de Mountain Bike', '<span style="font-family: verdana,arial,helvetica,sans-serif; color: rgb(204, 0, 0); font-weight: bold;">ESPORTE</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">A Federação Gaúcha de Ciclismo, com apoio da Prefeitura de Sapiranga, realiza neste sábado e domingo (23 e 24), a quinta etapa de Down Hill e uma prova extra de Four Cross. <br />
