INSERT INTO noticias VALUES (155, 2, 'Posto de Pronto Atendimento Médico ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">SAÚDE<br /><br style="font-family: verdana,arial,helvetica,sans-serif;" /></span><span style="font-family: verdana,arial,helvetica,sans-serif;">O Posto Municipal de Pronto Atendimento Médico 24 Horas (PAM) estará atendendo onde o Fórum estava instalado até o ano passado. A prefeitura de Sapiranga fez a reforma do prédio, a fim de instalar o serviço de atendimento de clínico-geral e pediatra, além de curativos e pequenos procedimentos. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (156, 2, 'Inscrições para Salão Pintando a Rosa', '<span style="font-family: verdana,arial,helvetica,sans-serif;"><span style="font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br /><br />Para fortalecer a rosa como símbolo de Sapiranga, os artistas plásticos são convidados a participar do VI Salão Oficial Pintando a Rosa, evento realizado pela prefeitura, por meio da Comissão Organizadora da Festa das Rosas e da Secretaria de Cultura e Turismo. A ficha de inscrição e o trabalho deverão ser entregues até a sexta-feira (29), no Centro Municipal de Cultura Lúcio Fleck.<br />
INSERT INTO noticias VALUES (157, 2, 'Encontrart vai reunir músicos no domingo', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><span style="font-family: verdana,arial,helvetica,sans-serif;">No próximo domingo (24), a comunidade de Sapiranga poderá conferir as atrações da décima edição do Encontrart, como é conhecido o Encontro Artístico Musical de Sapiranga. A partir das 20h30, o Centro Municipal de Cultura Lúcio Fleck sediará o encontro de músicos sapiranguenses, como Mauro Bernardes, Pedrinho, Beto Jacobino, Rafael Breyer, Paulo Fleck, Laurence Prezzi, Nana Bernardes e Rômulo Prezzi. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
INSERT INTO noticias VALUES (158, 2, 'Juramento à Bandeira será no sábado ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">GERAL</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">No dia 23 (sábado), às 9 horas, ocorre o Juramento à Bandeira, na Praça da Bandeira, em Sapiranga, sendo que os rapazes deverão comparecer uma hora antes para ensaio. <br />
INSERT INTO noticias VALUES (159, 2, 'Lixo não pode ser queimado', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">MEIO AMBIENTE</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">Uma placa fixada num terreno localizado na localidade de Travessão Ferrabraz, em Sapiranga, orienta as pessoas a queimarem o lixo doméstico. Segundo o Departamento Municipal de Meio Ambiente, o Código Florestal exige uma postura contrária.<br />
INSERT INTO noticias VALUES (160, 2, 'Irmãos de Fé terá mais uma noite ', '<span style="font-family: verdana,arial,helvetica,sans-serif; font-weight: bold; color: rgb(204, 0, 0);">CULTURA</span><br style="font-family: verdana,arial,helvetica,sans-serif;" /><br style="font-family: verdana,arial,helvetica,sans-serif;" /><font size="3" style="font-family: verdana,arial,helvetica,sans-serif;">O Centro Municipal de Cultura Lúcio Fleck estará exibindo o filme <i>Irmãos de Fé </i></font><span style="font-family: verdana,arial,helvetica,sans-serif;">no próximo sábado (23). A sessão inicia às 20h30. O padre Marcelo Rossi, Thiago Lacerda e Othon Bastos fazem parte do elenco. </span><br style="font-family: verdana,arial,helvetica,sans-serif;" />
